INSERT INTO `room` VALUES (52654, '佛山哥顿酒店', '酒店坐落在“大佛山顺德容桂”中心板块的中轴线，正对风景秀丽的花溪公园和狮山公园，步行可达渔人码头、大型购物中心海骏达广场、天佑城、柴油机1959文化创意园。约10公里内有知名的清晖园、风景宜人的顺峰山公园、宝林寺、亲子乐园顺德南宏海立方海洋公园、史努比公园、逢简水乡以及长鹿旅游休博园。15分钟车程可达顺德主要交通枢纽顺德港、顺德容桂站、顺德候机楼、容桂客运站。酒店拥有大型地下停车场，方便快捷。 \n酒店拥有舒适的客房，商务双床房、商务大床房、行政商务客房以及套房可以满足不同规模、规格会议团队的需求。客房及公共区域均可提供宽带上网，让商务资讯畅通无阻。\n顺德美食名扬天下，酒店有鲍翅海鲜酒楼，为广大宾客提供粤菜和地道的顺德美食。每一道菜肴都精雕细琢，每一次用膳都难以忘怀,让您享受愉悦的美食。二楼有汇集多国佳肴的西餐厅，为宾客提供地道的欧陆式美食以及异国风味美食。\n配置完善会议设施，拥有多个容纳15-850人的大、中、小型多功能会议中心和会议室，并拥有智能化系统。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区容桂街道容桂大道中38号（近福基路）');
INSERT INTO `room` VALUES (646683, '广州中心皇冠假日酒店', '广州中心皇冠假日酒店位处广州市繁华的环市东路核心商圈，多国领事馆及世界知名企业进驻，正佳广场及北京路购物街近在咫尺。四周交通便捷，距广州白云国际机场大约30分钟车程，距广州火车站及火车东站约15分钟车程，步行约200米即可抵达广州地铁站。毗邻中国进出口交易会流花展馆及广州国际会展中...', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '越秀区环市东路339号（近广东电视台）');
INSERT INTO `room` VALUES (915194, '佛山金雅轩大酒店(大沥新都会店)', '金雅轩大酒店是一家标准酒店，坐落于广佛交通中枢,素有“铝材领先镇”之称的大沥镇政府前侧，凤池装饰材料市场内。东连广州——距广州国际机场、广州新会展中心仅需三十分钟车程，南接佛山禅城区，在321和325国道的交汇点。交通条件得天独厚。酒店全新按高端标准设计和建设，建筑面积16800多平方米，尊贵典雅，优越奢华，豪华客房，环境幽雅的中、西餐厅、康体中心、娱乐KTV、棋牌室、国际会议厅等配套设施一应俱全，是商务接待、旅游度假理想之优选。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区大沥镇城南一路凤池装饰材料市场二期D1座');
INSERT INTO `room` VALUES (1293486, '7天酒店·佛山祖庙地铁站卫国路店', '分店已于2017年1月1日重新装修完毕，7天连锁酒店（7 Days Group Holdings Limited）创立于2005年，作为一家登陆纽交所的中国酒店集团，7天连锁酒店秉承让顾客“天天睡好觉”的愿景，以直销低价模式，快乐自主的服务理念，致力为会员提供干净、舒适、快乐的住宿环境和氛围，满足客户的核心住宿需求。 截至2013年3月31日，7天连锁酒店已拥有分店超1600家，覆盖全国223个主要城市，业已建成经济型连锁酒店全国网络体系。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '禅城区卫国路71号（近祖庙地铁站B出口、第三中学）');
INSERT INTO `room` VALUES (1293498, '天豪酒店', '酒店座落于广东省佛山市南海区松岗松夏工业园松夏市场侧，松夏工业园内，该工业园全部采用花园式管理。紧邻佛山新八景之一---南海南国桃园旅游风景区，南海影视城，狮山大学城，相距广州新机场、火车站仅25分钟车程，广佛高速出口、佛山一环出口相近毗邻，交通方便；大沥巴黎春天、大沥新都会、松岗商业步行街购物中心都在酒店附近。酒店具有现代化的智能保安系统；酒店共有设备完善的各色房间，所有客房均设下列设施：宽频上网、独立洗浴间、独立温度调节空调、吹风筒、卫星电视节目。多间瑰丽堂皇的宴会大厅，豪华舒服的贵宾厅房，佳馔荟萃其中。名厨精制中西美食，风味不凡，令人回味无穷。酒店集商务、住宿、娱乐、休闲保健、会议接待等综合服务于一身，功能齐全，设施完善，是阁下商务会议、休闲渡假、贵宾接待的选择。专业酒店的管理和体贴入微的服务，为高要求、高品味的您营做一个舒服的家，让您在紧张、繁忙工作之余，享受心灵上的世外桃源。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区狮山镇松岗街道松夏工业园工业大道东15号');
INSERT INTO `room` VALUES (1293860, '佛山仙泉酒店', '酒店位于广东省顺德区顺峰山旅游区，紧靠广珠公路，毗邻顺德港，水陆交通十分方便。酒店集度假与商务于一体，其独特的中华传统宫廷式建筑别具匠心，与湖光山色浑然一体。酒店拥有各式精致客房，中西餐厅各具风味，同时康、娱乐、商务、会议、旅游交通等综合性服务一应俱全，配以电脑系统管理，竭诚为中外宾客提供完善的服务。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区岭东路大良顺峰山旅游区对面');
INSERT INTO `room` VALUES (1295852, '维也纳酒店(佛山祖庙地铁站店)', '本店位于佛山市禅城区人民路101号，（佛山广播电视大学隔壁），毗邻祖庙，岭南天地，岭南站，祖庙地铁站。\n附近佛山知名旅游购物景点：祖庙，黄飞鸿纪念馆，仁寿寺，佛山岭南天地，百花广场，铂顿城，岭南站，南风古灶等。\n 周边旅游购物景点还有： 梁园 ，东方广场 ，千灯湖 ，万达广场， 季华园，创意产业园，\n距离广佛线祖庙地铁站仅3分钟，靠近市政府、中医院、妇幼保健院，琼花大剧院、大洋时代影城，岭南明珠体育馆，世纪莲体育馆，佛山科学技术学院、佛山大学。距离广州白云机场45分钟车程，广交会会馆40分钟车程，酒店位置优越，出行便捷，属城市商业中心地带。\n佛山周边拥有狮山工业园，三水广场 三水荷花世界，大沥布料交易市场，大良清晖园 ，容桂，顺德陈村粉，黄岐，西樵山，丹灶陶瓷园，交通便利，四通八达，佛山汽车站直线距离1公里范围内。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '禅城区人民路101号（佛山广播电视大学旁）');
INSERT INTO `room` VALUES (1488384, '佛山鹿茵酒店', '酒店是容桂涉外现代化豪华商务型酒店。坐落于位于世界美食之都、有家电国之称的容桂，是顺德交通枢纽中心，毗邻顺德港及欢乐海岸、轻轨站、步行可达海骏达城、天佑城，是容桂标志性的豪华地标.\n    酒店拥有各类风格舒适的豪华客房，配套设施齐全，实用美观，迎合个类宾客的不同需要。\n为广大宾客提供正宗粤菜和地道的顺德美食，酒楼包括同时容纳900人就餐的鹿茵殿和丽晶殿多功能厅，设有中小型宴会厅，还有1间豪华贵宾房满庭芳.是您商务活动或浪漫婚礼的上佳之选。\n 配备了完善了的会议设施，包括3间能容纳80-1000人的大中型宴会厅和多功能会议中心，拥有先进的智能化会议集中系统，多媒体演示系统等。\n    康体设施配SPA水疗中心、棋牌室、鹿茵会卡拉OK，酒店的康体设施为客人的休闲空间提供服务。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区桂洲大道中1号（近顺德大道）');
INSERT INTO `room` VALUES (2233174, '王子酒店(漠江路店)', '酒店位于阳江市江城区漠江路中段，直线距离精英学院300米，核心商圈百利广场、天润广场600米。距离沃尔玛购物广场1500米、福盈新达 城1800米。\n酒店近100米公交站有3.4.7.10.21路可通往汽车总站、高铁阳江站、人民医院、三人民医院、两阳中学、市一中学、职业技术学院、国际会展中心、  人民广场、市政府行政中心等\n酒店距离市汽车总站2.0公里、阳江职业技术学院2.6公里、阳江国际会展中心2.8公里、高铁阳江站5公里。\n距离海陵岛、闸坡大角湾风景区、保利银滩、恒大海上夏威夷、敏捷海岸40公里。\n酒店周边2公里内景点有北山公园、东岳公园、鸳鸯湖公园、金山植物公园。\n酒店设豪华大床房、商务大床房、商务双床房、家庭套房、亲子主题房，商务套房等。提供自助洗衣，自助健康早餐，停车场等服务。\n酒店客房设有冷暖空调，光纤专线网络，房间独立专线WiFi，保证上网体验；\n酒店员工以专心，专注的服务热情期待各方宾客到来。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区漠江路198号（距百利购物广场400米，距福盈新达城2000米）');
INSERT INTO `room` VALUES (2234021, '维也纳酒店(阳西月亮湾店)', '深圳维也纳酒店集团创立于1993年，作为中国中档商务连锁酒店领先品牌，秉承“深睡眠，大健康”的用户核心价值，致力于为客户提供健康 、舒适的高附加值产品及良好的睡眠体验。\n  维也纳酒店（阳西月亮湾店）隶属于深圳维也纳酒店集团,位于沙扒海滨旅游区核心地段，座落于美丽的沙扒湾海边上，拥有180°全景观光阳台，可 一览整条海岸线，大门与沙滩，一步之遥，听着海浪扑打的声音和迎面吹来的徐徐海风，最感觉妙不可言。与酒店相对望的是阳江八景之一的青州岛美景，岛 上气候温和清爽，棕榈成林，有刺激的潜水观景地点 ，设施完善，在岛上能把祖国南海的美丽风光一览无余。\n　　酒店采用欧陆风情设计，设有各类豪华客房及套房105间，配备冷暖变频空调、24h热水供应、液晶电视、无线网络（WIFI），床等，各消费层次  的舒适客房能满足不同宾客的入住需求。附设观海阳台、餐饮、书吧等配套设施，实为商务洽谈、旅游观光、休闲娱乐的上佳之选。\n    酒店周边景色宜人，山景房可观风光旖旎的烟登岭，海景房可观180°的一线海景，在这里您尽可以畅享“面朝大海，春暖花开”的惬意。另外特色  小吃街、银行，超市，餐馆，当地特产小店样样俱全。沿街奢华唯美的建筑风格，以及椰风金沙的银滩海岸，你大可抛开繁忙紧张的都市生活，全身心的体验 地地道道的海岛生活。\n    维也纳酒店月亮湾店秉承“服务至上”的服务宗旨，热情欢迎您的到来，我们将竭诚为您提供宾至如归的优质服务。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇海滨旅游区海滨路2号');
INSERT INTO `room` VALUES (2234032, '阳江海韵戴斯酒店', '酒店位于阳江市海陵岛经济开发试验区海陵大道十里银滩前端，毗邻名扬国内外的“南海一号”海上丝绸之路博物馆，是阳江市一座具备旅游观光和商务休闲功能的豪华海滨度假式酒店。\n酒店主楼中空大堂及花园广场气势磅礴、美伦美焕，具有典雅的欧陆风格和浓郁的东南亚热带风。各类优质客房，装潢典雅大方，环境清雅舒适，是宾客放松身心的理想休憩地。\n【光纤·网络】酒店wifi覆盖，千兆光纤网络，瞬息千里； \n【交通便利·汽车站】距闸坡客运汽车站3公里米，车程8分钟； \n【交通便利·高铁站】距阳江高铁站约40公里，高铁站有直达闸坡专车； \n【服务·承诺】酒店全自动洗涤房，确保布草的质量，干净卫生一客一换；\n【停车】酒店配置露天停车场和地下停车场，保安巡逻+24小时监控； \n【周边·景点】周边风景优美，椰林成荫，水清沙幼、碧海蓝天，沙滩阳光普照； \n【医疗·健康】酒店配置医疗室可简单处理伤情，距离镇卫生院约3公里车程8分钟；\n【娱乐·购物】酒店4楼大厅可购买海陵岛特产，距一夜程海味街约3公里车程8分钟，小吃一条街。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区经济开发试验区宋康大道十里银滩东北100米（南海一号旁）');
INSERT INTO `room` VALUES (2309784, '台北老爷大酒店', '老爷大酒店是台北所能提供之最方便的落脚点. 饭店所有202间客房,装潢舒适优雅,提供予商务和休闲旅客。', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '中山区中山北路二段37-1号');
INSERT INTO `room` VALUES (2376478, '柏丽酒店(佛山顺德乐从总店)', '柏丽酒店（乐从总店）是柏丽集团旗下精选物业之一，为广东柏丽酒店之总店，位于素有“中国家具商务之都”之称的顺德乐从商业区之繁华地带，相邻国内大型的家具展览中心、家具会展、罗浮宫家具城、顺联家具城、乐从文化公园，毗邻家居博览城、龙威木材市场、佛山机场、105国道、距广州白云机场及中国进出口商品交易会会场仅45分钟车程，地理位置优越便捷，水、陆、空立体交通十分发达。 酒店是一家以尊贵、商务、文化、时尚为理念的高档型商务精品酒店，拥有各式豪华客房160间，独特的设计风格和考究的细节装饰，将四大理念优质结合。所有房间均配WIFI、宽带上网，让您随时享受网上工作与娱乐，同时配有迷你吧、IDD电话、办公设备及私人保险箱等现代化设备，基于人性化的客房布局，还特设有无烟楼层。酒店集各国风味的中、西、海鲜料理餐厅、沐足休闲会所、棋牌、商务会议、商务中心等配套设施一应俱全，完善的设施与臻力求精的服务，是阁下商务休闲、尽显您尊贵身份之优选酒店。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区乐从大道东A16号（近罗浮宫，乐从家私城斜对面）');
INSERT INTO `room` VALUES (2386755, '7星酒店公寓(五一广场地铁站店)', '本公寓位于长沙五一广场 景江东方大厦东门八楼807室。酒店交通便利，设施齐全，让您感受如同在家的温馨舒适。本店位于长沙市天心区五一广场2号地铁1号出口旁边，公寓酒店拥有：温馨情侣大床房、商务双床房。环境舒适、空气流畅，本酒店交通便利，距离火车站仅5.1公里，车程16分钟。距离橘子洲头仅1公里，距离步行街，坡子街，火宫殿300米。距离岳麓山1公里是您旅行、出差的好选择。\n公寓酒店有停车场 支持信用卡/银联刷卡 ，有洗衣机 24小时前台接待服务 ，行李寄存 。房间设施电吹风 ，空调  ，WIFI上网， 24小时热水。随到随住。服务快捷。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区五一大道景江东方大厦8楼807室（近景江东方东门、五一广场地铁站1号口）');
INSERT INTO `room` VALUES (2394005, '广州圣丰索菲特大酒店', '酒店地处广州天河区中心地带，广州市繁华的金融及商业区，举步可至城市地标中信广场，邻近广州火车东站，连接广州、东莞、深圳及香港的交通枢纽。拥有独特的艺术气息与风，为宾客带来独特的传统文化及艺术品味及享受，是商旅宾客的下榻选择。酒店拥有各类独特风格的客房与套房，客房内提供网络、进口洗浴用品等，住宿环境优越。酒店同时设有创新的餐厅与酒吧，具艺术品位的会议室包括一间大型宴会厅。会议室配备同声传译设备，更有灵感会议香氛。酒店内设香榭丽舍扒房、中餐厅、全日制自助餐厅等，为宾客带来各类美食。酒店致力传承传统的艺术及文化，为宾客带来近乎优质的享受。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '天河区广州大道中988号（近天河北路）');
INSERT INTO `room` VALUES (2438078, '广州花园酒店', '本店展现了广州传统与现代的融合。酒店位于商业区之中心地带，拥有多种类型客房间客、套房及150套公寓。9间餐厅、8间多功能会议室和1间国际会议中心。本店是同时拥有4家米其林餐厅的酒店，包括泰安门广州、桃园馆、荔湾亭、斯蒂勒共四家米其林获奖餐厅。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '越秀区环市东路368号（地铁5号线淘金站A出口）');
INSERT INTO `room` VALUES (2664770, '旺百利酒店(大沥凤池步行街店)', '酒店位于佛山市南海区大沥镇图强路，距离南海新都会购物中心仅300米，凤池材料市场180米，大沥汽车客运站9分钟车程，距离佛山西站10公里，在日新月异的城市中为您营造温暖如初的惬意居所。酒店演绎了品牌优雅的魅力，致力为每位商务及休闲旅者提供精致的入住体验。独具匠心的格调设计，通过高低、色调、灯光效果的变化，将原木、石体、金属、青砖等天然建筑材料被纯熟地运用于酒店的各处，大型程度地体现对于材质的认知和尊重，摒弃了流于表面的矫饰，呈现惬意的新体验。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区大沥镇图强路7号');
INSERT INTO `room` VALUES (3250848, '维也纳国际酒店·长沙铁道学院店', '本店位于长沙市韶山南路，中南大学铁道学院正对面，咫尺长沙市中心医院、华翼府，毗邻中南林业科技大学、湖南广播电视大学、雨花亭凯德购物广场，临近湖南大众传媒职业技术学院(雨花校区)、长沙民政职业技术学院、湖南省政府和红星德思勤城市广场商圈。酒店距离地铁1号线铁道学院站4号出口约1.1km；临近长沙国际会展中心约25分钟车程，五一广场步行街约20分钟车程；橘子洲头约20分钟车程，岳麓山风景名胜区约25分钟，交通便利。酒店集客房、餐饮、会议、休闲、娱乐KTV为一体，设有欧陆风、温馨舒适的各类房间，所有客房均设有中央空调、私人卫浴、无线宽带网络、卫星闭路电视、国际直播电话、24小时冷热水供应，以舒适典雅、健康美食、豪华品质、环保、音乐艺术、健康好眠让你尽享家的温馨。酒店拥有大、中、小型会议室，设施先进，功能齐备，可承办公司年会、团拜宴、培训会等各类商务会议，能够充分满足您的多重需求。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '雨花区韶山南路133号（近铁道学院、长沙市中心医院）');
INSERT INTO `room` VALUES (3287010, '汉庭(广州三元里地铁站店)', '酒店位于广州地铁2号线三元里地铁站A1出口直线距离约300米，步行3分钟可到达酒店。地铁2号线直达广州南站、距广州火车站仅1个地铁站，广州白云机场地铁换乘等十分便捷40分钟可到达机场。地铁2号线换乘地铁8号线可达琶洲会展中心，酒店周边聚集广州服装批发城、鞋城、化妆品、皮具、五金批发城中心地带，酒店交通便利，门口是公交车站瑶台站，周边配套齐备，餐饮食肆、商场、购物齐全、白云山风景区等，本店给您真诚的服务，欢迎您的入住体验。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '越秀区广园西路342号（妇幼保健中心旁）');
INSERT INTO `room` VALUES (4072140, '阳江海陵岛保利皇冠假日酒店', '本酒店位于海陵岛十里银滩，毗邻广东海上丝绸之路博物馆（南海一号）及南海高尔夫球场。酒店前往大角湾景区、一夜埕购物街、妈祖庙 等都很方便。\n　您在房间里就能远眺峦山叠翠、近观碧海蓝天，熨衣设备、小冰箱、迷你吧等设施一应俱全。皇冠亲子房里的独立室外泳池，更是深受小朋友的喜  爱。 \n　　月色全日制餐厅、海膳捞特色火锅餐厅、地道海陵岛本地风味的御公馆中餐厅提供各式美食，定能让你的味蕾得到充分满足。 \n　　阳光猛烈的下午，小朋友可以在儿童乐园尽情玩耍。你也可以到游泳池畅游，在设备齐全的健身中心健身，网球场打球或是到静谧的水疗中心体  验一次按摩护理。\n　　另外，酒店还设有充电桩以方便电动车自驾游的宾客。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道海陵岛十里银滩N区（近南海1号馆）');
INSERT INTO `room` VALUES (4100320, '凯旋大酒店', '永州凯旋大酒店位于育才路，近冷溪路，距汽车北站仅3分钟车程，是永州市领先家按标准兴建的精品酒店，地理位置优越。　　永州凯旋大酒店拥有各类精致的客房及套房等，并设有美食城与会议室，可满足不同宾客的消费需求。酒店三楼有美食城，二楼有休闲会所，配套设施一应俱全。酒店高雅、时尚的氛围、细致入微的服务将成为您体验尊贵、高雅、浪漫、舒适的优选之所。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '冷水滩区育才路88号（龙兴凯旋城4楼）');
INSERT INTO `room` VALUES (4103559, '克洛维斯海景公寓(海陵岛十里银滩店)', '本店坐落于广东省阳江市海陵岛保利银滩西区（P区），景区“十里银滩”上盖公寓。公寓主打180度海景房，可将碧蓝辽阔的海景尽收眼底、注重悦居悦美理念，天然的开放式设计、风景充满每一角落的各式房间、全身心投入自然怀抱的感动。 酒店拥有各类豪华客房。每间客方带有 独立的海景阳台、卫生间、空调、彩电、冰箱等设施；房间的床被都是酒店所使用的太空棉被，温馨舒服。在房间穿好泳衣，楼下即是景区“十里银滩”，步行至沙滩游泳只需约5分钟，地理位置非常优越。 本店以浪漫为主，不同房间的布置装饰，让您有耳目一新的感觉，公寓秉承优质、贴心的服务，让您在享受领略十里银滩海韵的同时，感受到家的温馨，是您浪漫悠闲度假的理想下榻之地。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道海陵岛保利银滩p区7栋106铺（离海边200米,距大角湾3800米）');
INSERT INTO `room` VALUES (4212686, '城市便捷酒店(阳江漠江路店)', '酒店位于广东省阳江市江城区漠江路396号，交通便利、地理优越，周边生活配套设施齐全。酒店装修沿袭城市一贯的简约、时尚风格，设  有多类客房可供选择。客房内设有24小时热水、独立卫浴、电视、空调、光纤、WIFI覆盖等，设施齐全。\n        酒店配备有自助餐厅、自助洗衣房、自助商务吧、书吧等设施，是您商务旅行、休闲娱乐的理想下榻之地。\n       酒店周边购物及旅游胜地，距离着名旅游海滨闸坡仅40公里，距离全国咸水矿温泉40公里（阳西咸水矿温泉），距离山水园森城阳春仅45公里 。周边购物广场，百利广场800米，沃尔玛900米，大润发700米，鸳鸯湖2公里。距离阳江汽车站4公里，距离阳江高铁站10公里。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区漠江路396号（近百利广场、北湖公园）');
INSERT INTO `room` VALUES (4276121, '天福大酒店', '永州天福大酒店位于湖南省永州市冷水滩区梧桐路777号，酒店东面是风景优美的永州职业技术学院，南面是永州目前繁华的商业广场——愿景国际广场，西面紧临冷水滩区政府。距离永州高铁站3.2公里、永州机场15.8公里、汽车西站仅550米，市内多路公交车，包括从高铁站直达零陵古城301、302公交车、从高铁站直达永州植物园的10路公交车，在酒店大门前左右方停靠，交通极为方便。\n     酒店客房为简欧式风格，设有多种房型、棋牌室，可满足不同客人需要。客房设施高档、齐全、洁净、舒适，超值享受。\n　  酒店拥有大、小不等的宴会厅12个，包厢10个，就餐总座位达2000余位，各款喜宴制作，领路永州餐饮市场，现已成为永州酒店行业著名品牌。\n     酒店能接待大、小会议及各种类型的培训班，有容纳50人至200余人的多功能会议室5个，负一楼有80个车位，免费为消费者泊车。\n      天福大酒店为产权式酒店，自主经营、自主管理，遵循“宾客至上”的经营理念，将以一流的管理、一流的服务，让您高兴而来，满意而归，就是酒店要追求的目标。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '冷水滩区梧桐路777号（区政府旁）');
INSERT INTO `room` VALUES (4365496, '贞观假日酒店', '客房干净、卫生，具有基础性设施，住宿环境舒适；', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '零陵区芝山路永州商业城对面');
INSERT INTO `room` VALUES (4901741, '爱琴海假日酒店', '本店客房温馨舒适，服务周到热情，竭诚欢迎您的光临。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '冷水滩区育才路18号');
INSERT INTO `room` VALUES (4995625, '美好海岸宾馆', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇海滨东一街48号（距沙扒湾海滩20米，近青洲岛景点）');
INSERT INTO `room` VALUES (5636907, '名濠饭店', '酒店位于阳江市东风二路1-3号，属于市区中心繁华的商业街，吃饭行街好去处，邻近附近百利广场，铜锣湾广场，邻近东岳公园，方便前  往市政府和鸳鸯湖公园，四周生活设施配套完善，位于市中心，交通出行十分便利。距离阳江高铁站6公里，距离海陵岛，闸坡大角湾风景区，保利银滩，恒  大海上夏威夷，敏捷海岸45公里。四周生活设施配套完善，交通出行十分便利。酒店布局现代、简约、便捷，内设中餐厅，咖啡厅，房内基本设施齐全，住宿 环境十分温馨，是商务、旅游和休闲的理想场所。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区东风二路1号');
INSERT INTO `room` VALUES (6311787, '私享家度假公寓(海陵岛保利十里银滩店)', '本店坐落于广东省阳江市海陵岛十里银滩西区，毗邻景区“十里银滩”，每间房都拥有一线海景。公寓装修独特，分为东南亚/现代两种风格  ：【东南亚风格】融合热带海岛特色。广泛运用深色天然木质原材料，局部采用金色壁纸、丝绸质感的床幔，浪漫气氛的灯光，无处不体现出稳重及奢华感； 【现代风格】采用都市生活+风格建筑生成概念，让居住者深深体验一种时尚化、个性化、现代感、都市化的生活。　　公寓别具一格的豪华东南亚/现代风格 主题房，多变的是房型，优选不变的是窗外一线海景，大海沙滩蓝天白云扑面而来；公寓周边景点、特色小吃街、银行，超市，餐馆，百货商店样样俱全，让 你360°体验地地道道的海岛生活；公寓内冷暖变频空调、24h热水供应、液晶电视、床等设备全是崭新的，温馨舒适的家庭式服务，奢华唯美的建筑风格，是  您到海陵岛住宿旅游的理想选择。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛南海1号大道保利十里银滩海洋之心P区8幢02号');
INSERT INTO `room` VALUES (6725046, '台北莎多堡奇幻旅馆', '在繁华的美丽华百乐园与内湖科技园区之间，充满科技与现代感的都会区，惊艳遇见一座中古世纪的金色古堡 ― 莎多堡！是全台领先座以城堡式外观设计的奇幻主题旅馆。它的现身，为台北都会区带来新鲜感；奇幻主题的建筑，更为高科技的内科地区增添了丰富的艺术气息。　　莎多堡特别敦请三门联合建筑师事务所的白省三博士设计监造，并礼聘留英的张顺云设计师以”Theme Hotel”的概念，为旅馆量身订做。　　『这里的每一个房间，本身就是『一出完整的戏剧』，拥有独特的场景设计，魔法般的科技效果，幻化多变的灯光效果，加上无可限量的想像空间，无不追求五感官能的震撼力！』张顺云表示。　　除了以客为尊的精致服务，莎多堡加上杰出的设计美学，让您轻松脱离乏味的日常空间，切换进入浪漫与想像交织的奇幻之境。现在，请充分享受这独一无二的美好时光。', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '敬业二路75号');
INSERT INTO `room` VALUES (40051881, '希尔登商务电竞酒店', '交通位置便利，周边配套齐全，装修风格精美，价格实惠，性价比高', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '祁阳市金盆西路102号');
INSERT INTO `room` VALUES (40143533, '潇湘维多利亚酒店', '潇湘维多亚利酒店客房采用简约欧式风格设计，搭配元素仿古木纹地砖。柔和可调光源，宽敞明亮，地处潇水河畔，空气清新，景色怡人，是道县理想的商旅休闲去处。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '道县滨河路171-177号');
INSERT INTO `room` VALUES (40801917, '非凡假日酒店', '装修装饰新颖独特豪华，风格各异，性价比高，住宿环境、通风采光较好，停车方便，有酒店专用地上停车场和地下停车场，均提供。走出酒店就是道县繁华的地段，酒店500米范围内就是大型步步高、大润发等超市，旁边就有肯德基、电影院、步行街、洗浴城、酒吧、大饭店、KT∨等，吃喝玩乐就在眼前，本酒店位置好，闹中有静，位于金通运贸城内。交通很方便，四通八达，到火车站5分钟，到道县新车站2分钟，到上关车站3分钟，到汽车北车15分钟。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '道县潇水中路金通院内');
INSERT INTO `room` VALUES (41997710, '福华精品公寓(佛山顺德大润发店)', '本店客房温馨舒适，服务周到热情，竭诚欢迎您的光临。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区延年路15号大润发旁');
INSERT INTO `room` VALUES (42026281, '麗枫酒店(阳江西平路沃尔玛店)', '本店位于阳江市江城区西平路，附近有沃尔玛、百利广场、盈信广场等大型综合商场和各类商铺，距离景区，十大宝岛之一的海陵岛约43公 里，另市区周边密布马尾岛、东方银滩、北洛湾、珍珠湾、凌霄岩、大角湾等知名海滨、森林和温泉景点。\n这是铂涛集团倾力打造的以天然香气为特色的舒适体验型连锁酒店，拥有特色的商务社交空间住宿，高端时尚灵活宽敞的空间。客房灯具触控开关，  电动窗帘开关，无线WIFI酒店无死角覆盖等先进的设施设备，配套齐全。设计集古典优雅韵味及时尚格调于一身，撷取时尚经典的当代设计美感，空间宽敞感 和舒适度得以大化提升，是您商旅、洽谈、会友的好去处。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区西平北路169号');
INSERT INTO `room` VALUES (42338127, '月亮湾海韵海景度假公寓(阳西沙扒滨海度假乐园店)', '月亮湾海韵度假公寓位于月亮湾滨海度假村，移步即达月亮湾海滩，湾似虹，沙如玉，岸边绿林含翠，海面碧波粼粼，是大自然的天然浴场 。周边有渔船码头、海鲜市场，近距离领略美丽富饶的渔港风情、底蕴深厚的渔家文化与疍家文化，美食、休闲、娱乐精彩纷呈。\n月亮湾海韵度假公寓整体装饰简约雅致，客房舒适齐整、宽敞通风；房内配置有线电视、独立wifi、24小时热水、独立卫浴等设施，阳台可以观看美  丽的海景。海滨浴场内提供有沙滩摩托、香蕉船、飞艇、烧烤烟花晚会，非常热闹，使宾客尽享愉悦的入住时光。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县椰林路月亮湾海滨国际旅游度假区金兰湾2栋1楼大堂（距海滩400米,近海韵广场）');
INSERT INTO `room` VALUES (42896728, '佳成国际大酒店', '道县佳成国际大酒店是一家集住宿、餐饮、商务、会议、健身、休闲等多元化服务于一体的豪华综合型酒店，雄踞道县核心商圈，距道州火车站、厦蓉、道贺高速入口5分钟车程，交通十分便捷。酒店主楼共19楼，是城区的标志性建筑。肯德基、步步高超市、步行街、影院等商家等如众星拱月般环伺四周。酒店建筑面积3万余平方米，有装修豪华餐饮包厢17个，宴会厅2个；大型多功能会议厅功能齐全，提供一流的多媒体设备，商务服务一应俱全，是您商务会议、政府接待、旅游休闲的上好选择！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '道县潇水中路138号');
INSERT INTO `room` VALUES (51025223, '北投热海温泉大饭店', '酒店在北投区的中心，周边交通便利，到北投温泉博物馆,北投公园,新北投站等地方都很近，酒店内设施齐全，浴室,禁烟房,吹风机,免费瓶装水,空调。同时可享受停车场,电梯,会议设施,餐厅,24小时客房服务。这些设施让酒店成为理想选择。', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '光明路258号');
INSERT INTO `room` VALUES (52462516, '沙扒湾沙巴岛别墅', '本店位于沙巴岛别墅B区，地处繁荣中心地段，有（三房二厅电梯公寓），（独幢四房二厅、五房二厅、六房二厅）还有：（七房两厅，八  房两厅：是自建房屋，有房东热情招待）新房豪华装修，家电齐全，有厨房，提供烧烤场地和烧烤炉。干净通风赞，安静光线好，房间整洁温馨，胜过酒店设 备，提供一次性洗漱用品，独立洗手间，无线WIFI，24小时热水，竭诚为您提供优质的住宿环境。让您住得舒心，玩得开心，吃得放心，优选的宗旨，重要是 服务到位。（步行三分钟左右到海边，二分钟到饮食购物商业街，即海味一条街，五分钟左右到达海鲜市场，100米内数十几家海鲜大排档，交通便利，私家  车停放在门口，可停放三台）。别墅为您提供干净，舒适，温馨，优质的一条龙服务。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇沙扒湾沙巴岛11栋B05号');
INSERT INTO `room` VALUES (52487938, '台北北城大饭店', '北城大饭店位于台北的绝佳观光.购物.餐饮地段 北城提供舒适的环境 离台北机场只要10分钟的车程交通方便　　Excellent sightseeing in Taipei. Shopping. Dining locations north of the city to provide a comfortable environment from Taipei airport only 10 minutes drive from the convenient transportation', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '长春路279号');
INSERT INTO `room` VALUES (62136475, '阳江蓝涛别墅(十里银滩店)', '别墅位于阳江市海陵岛，地理位置优越，毗邻南海一号博物馆、大角湾景区等网红打卡点，出了小区步行到十里银滩大概500米，别墅设施  齐全，有泳池别墅、花园别墅、阳台景观等，别墅配置独立厨房、冰箱、KTV、自动麻将机、电视、空调、24小时管家服务、无线网络等，集休闲娱乐于一体  。每年淡季都投入资金修葺，维持别墅内外整体美观，更新别墅设施配置，提高客人体验感，亲友聚会、休闲度假、商务出行，是您理想的选择。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道保利银滩旅游区B区明月郡别墅');
INSERT INTO `room` VALUES (62866893, '沙扒湾君度假日酒店', '君度假日酒店，建成于2015年8月，位于广东省阳西县旅游名镇沙扒的海滨东路，与沙滩碧海一街之隔。酒店环境安静舒适，风景宜人，离  闹市区有恰到好处的一小段距离，离沙滩下海处也仅有两三分钟的脚程。酒店整幢十二层半，共有住房六十多间，望海房约占三分之二，城景房约占三分之一 ，另外顶楼还有一间包揽城景海景的空中套房。望海房配有一个独立阳台，可二百七十度尽览浩瀚海景，顶层的空中套房外的大阳台更是看海、观星、娱乐、 庆贺的绝佳场所。酒店房间均安有豪华型的床褥卫浴配套设施，床褥铺陈美观大方，悦目舒爽，洗浴室使用著名卫浴品牌TOTO的高端配置。其他设施也品位高 档，配置齐全。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇海滨东路18号');
INSERT INTO `room` VALUES (80823792, '阳光半岛酒店公寓(海陵岛大角湾店)', '酒店距离海上丝绸之路博物馆——“南海一号”，约5分钟车程；与景区海陵岛大角湾游泳浴场相距约200米；门口约20米就是靓丽的海滩，可近距离触摸无边无际的蓝天与碧海。海陵岛是广东第四大岛，素有“南方北戴河”之称，被评为美十大海岛之一.（温馨提示；本酒店公寓不包含停车费，停车需收费，费用具体咨询商家）', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区海陵岛闸坡镇旅游大道阳光半岛度假公寓B栋3楼305室（距离大角湾水上乐园风景区300米，螺洲海际酒店旁）');
INSERT INTO `room` VALUES (80856182, '新北丽京栈酒店', '新北丽京栈酒店（Hotel Intrendy）位于交通主要干道上，即将营运之机场捷运线-泰山贵和站步行只要2分钟，从饭店出发到桃园国际机场只要20分钟，辅大花园夜市10分钟，步行8分钟至捷运丹凤站，前往台北车站连结四通八达捷运网。', 1, 9, '2022-12-15 16:23:14', '2022-12-15 16:23:14', '新北大道七段36号（近德安街口）');
INSERT INTO `room` VALUES (85121504, '西悠巢旅台北馆', '本店客房温馨舒适，服务周到热情，竭诚欢迎您的光临。', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '台北 大同区 台北市大同区民生西路198号2楼');
INSERT INTO `room` VALUES (90214332, '海陵岛保利海豚湾度假别墅', '本店位于广东省旅游景区海陵岛保利银滩别墅旅游区B区，保利银滩是保利地产集团的优质滨海旅游项目，占地面积广。本店配套设施齐全  ，观景高尔夫球场，临近南海一号博物馆、十里银滩、保利银滩、大角湾等景区。环境优美，是旅游度假休闲娱乐的好去处！', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道保利银滩旅游区B区明月郡别墅群B4栋02房1楼（近南海一号博物馆）');
INSERT INTO `room` VALUES (90811557, '台北西门享乐文旅-康定馆', '台北西门享乐文旅-康定馆(Hedo Hotel Ximen Kangding,Taipei)坐落于繁华热闹的西门商圈，邻近台北车站，台北市中心的交通枢纽地带，房间位于闹中取静的街道上。', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '万华区 康定路32号');
INSERT INTO `room` VALUES (90863437, '凯瑞阳光智能酒店(祁阳市政府店)', '本店是一家按照“美学融合、格调高雅、智能操控、舒适温馨、绿色环保、茶韵满堂、书香四溢”等设计理念、元素和风格，通过精雕细琢打造而成的崭新高品质酒店。\n        酒店地理位置优越，地处祁阳县城新区核心地段内的市场二路与322国道祁阳大道杨梅湖高架桥交汇处，与县行政中心、陶铸广场、陶铸公园、商业圈、加油站等融为一体，同时，距离高铁站、汽车总站仅5分钟的车程，以及车位充足、安全可靠的硬核条件，将为您提供十分便捷的交通优势和轻松称心的停车需求。\n     本店无论是高端大气的外观装修，还是雍容华贵的入户大堂，现代与中式糅合的装修风格，清新明快的色调搭配，舒适温馨的客房（包括各类型的精品或豪华单间、双人间、套房、棋牌房以及配置茶具茶室的套房），品质上乘的设施设备，智能化的声控操作系统，宁静致远的VIP茶室（会客室），古今中外的藏书角，丰俭由人的餐厅等等，这里是您旅行栖身、洽谈商务、休闲娱乐的惬意港湾！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '祁阳市祁阳大道红星美凯龙对面');
INSERT INTO `room` VALUES (92120283, '沙巴岛近海别墅', '本店房间配套设施齐全，环境温馨舒适，服务热情，重要的是价格优惠。本店提供无线WIFI（100M光钎），配套大型停车场，交通十分便利 。步行到海边只要3分钟，2分钟到海味一条街，5分钟到沙扒海鲜市场。你导航到这里，我们会热情的接待你，祝您生活愉快！', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇旅游大道别墅区B区（沙巴岛酒店旁）');
INSERT INTO `room` VALUES (97117071, '广州珠江新城希尔顿欢朋酒店', '酒店位于珠江新城与体育中心双商圈交汇处，地处中央商务区核心地段，毗邻广州国际金融中心、中信广场、琶洲国际会展中心。酒店去往海心沙广场、天河城购物中心、太古汇等城市热门旅游、休闲、购物中心等方便快捷，步行即可到达暨南大学、华南师范大学等高校。这里设计简约时尚，集聚会、休闲、商务功能于一体，拥有特色的“HUB”大堂。多间舒适客房使用“HamptonBed”标准的双专利床垫和生态认证床上用品。餐厅为你提供清新营养的健康热早餐、种类丰富的各式简餐和蔬果饮品，让你体验高品质的健康饮食。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '天河区黄埔大道西495号');
INSERT INTO `room` VALUES (99373851, '香蕉青年旅舍(黄花机场店)', '本店是一个以旅行，阅读，音乐为主题的青年旅舍，作为一家在您旅途中驻足的驿站，本店环境雅致，房间舒适温馨，全部房间均提供百兆高速无线网络。本店座落于黄花机场机场大道上，距离黄花机场仅有896米，地理位置优越，交通十分便利。本店提供接送机服务，办理登机牌服务，代办售票等服务。本店希望让每一位到来入住的客人都能感受本店如家般的温暖。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '长沙县临空南路盛地领航城3栋105门面（黄花机场t2航站楼对面，距离机场800米）');
INSERT INTO `room` VALUES (99646839, '奥诗咔艺术酒店', '本酒店客房温馨舒适，服务周到热情，免费停车场，无线网络，有餐厅，24小时热水，超大宽屏电视，带冰箱，奥诗咔艺术酒店所有员工竭诚欢迎您的光临。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '江永县永明东路江永妇幼保健院旁');
INSERT INTO `room` VALUES (109767545, '保利十里银滩海边公寓', '保利海陵岛度假村保利P区海边公寓位于阳江市海陵岛十里银滩西区，离5A景区“十里银滩”百米直线距离，毗邻“南海一号”水晶宫约5分钟车程。这里是一座集娱乐、休闲、餐饮、购物、居住、商务于一体的东南亚风情度假公寓，也是保利地产集团滨海旅游项目，总占地约3000亩，规划容积率0.42。规划建设内容包括：四家豪华型酒店、18洞跨海高尔夫球场、大型生态体育公园、海景高层住宅和低密度住宅。旨在塑造面向广东以及珠江三角洲、乃至全国的，集海滨度假，运动休闲、 康体养生为一体的生态型滨海国际旅游度假目的地和休闲社区。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利海洋之心保利银滩P区13栋1楼（距海滩300米）');
INSERT INTO `room` VALUES (114539495, '艺尚宫生活住宿酒店(江南西地铁站店)', '酒店是比较稀有的主题客房与商务客房同时运营的高性价比生活住宿主题酒店。\n商务类的房间以简约、简洁的风格为主，客房配置了智能系统，浴室和洗漱空间做了干湿分离设计，与周边酒店对比很好的解决多人入住时相互干扰的问题。\n主题类客房每一个房间都有独特的风格，彰显个性化设计。客房里面除了配置智能系统外，独立的蓝牙背景音乐系统也是该酒店的特有功能（可以手机连接，很多人除了享受音乐外还会用来做浪漫表白和求婚使用。），主题房里面的浴缸，酒店位于江南西，珠江南（河南）地区。一公里范围内有江南西地铁站、昌岗地铁站、沙园地铁站。地处地铁2号线江南西站B出口附近，周边有很多的小吃，还有很多网红打卡的小店，吃喝玩乐一整条街都可以满足，是广州情侣约会的胜地。酒店近江南西地铁站、昌岗地铁站、市二宫地铁站、海珠广场地铁站、沙园地铁站、凤凰新村地铁站、宝岗大道地铁站、太古仓码头、富力海珠城、万国广场、广州中医药大学附属骨伤科医院、广州医科大学附属第二医院、南方医科大学珠江医院、广州市海珠区妇幼保健院、广州市红十字会医院、广州医科大学附属第1医院、中山大学孙逸仙纪念医院、广百百货(广百广场店)、富力海珠城、江南西人商场、广百新一城、江南新地商业街、凯德乐峰广场(工业大道北店)、丽日商业广场等地方，且酒店去广州火车站、广州南站、广州东站、广州塔、琶洲、珠江新城、客村、白云国际机场、体育西路、北京路步行街、长隆欢乐世界等地方也是非常方便的。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区江南西路97号（近昌岗地铁站、太古仓网红街）');
INSERT INTO `room` VALUES (119985487, '富信大饭店(新北二馆)', '', 1, 9, '2022-12-15 16:23:14', '2022-12-15 16:23:14', '大同路一段128号');
INSERT INTO `room` VALUES (154092326, '趣墅度假别墅(海陵岛保利银滩店)', '本店作为“趣味度假魔法师”的首倡者，我们希望为客人带来有趣而美好的度假体验。无论是家庭度假、亲友聚会、公司欢聚，或是商务接待 等，都能为你提供优质的度假地。目前，已遍布华南热门旅游目的地，同时，也即将进驻三亚、杭州、成都、重庆等地，让更多人可以睡进有趣的度假别墅， 躺进1000种理想生活里。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道保利银滩B区1102');
INSERT INTO `room` VALUES (155929199, '海洋之心缘之度假公寓', '酒店位于阳江市海陵岛十里银滩西区，景区“十里银滩”百米直线距离，风光毓秀，粗犷壮阔！到水晶宫只需5分钟车程。出门就是海滩，阳光、海浪、比基尼，身在酒店就能将海景纳入眼底。这里集娱乐、休闲、餐饮、购物、居住、商务，海景房、豪华舒适家庭房、甜蜜温馨大床房......都将带给您不一样的旅游体验！', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道海洋之心P7栋一楼（近海鲜市场、十里银滩）');
INSERT INTO `room` VALUES (156591563, '维也纳国际酒店·广东阳江江城区中心店', '本店坐落于江城区漠江路559号，是维也纳酒店集团旗下中档精品酒店，酒店按照国际高端标准建造装修，拥有各类豪华房、商务房、套房  ，配备设施一应俱全，多功能会议中心、酒楼、卡拉OK沐足城等。所有房间均提供宽带上网端口、WIFI、卫星电视、国际、国内直拨电话、超豪华型的标准配 置浴室3秒速热沐浴系统，24小时不间断享受按摩般的淋浴体验。酒店紧邻325国道，距5景区海陵岛仅需35分钟车程，步行大润发购物商城3分钟。距鸳鸯湖公 园，金山物园仅需3分钟车程，周边商场国美电器，天润广场，沃尔玛等，购物非常便利，距阳江江城区政府仅需5分钟车程，是商务旅游、购物、会议宴会等 休闲娱乐活动的理想选择。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区漠江路559号');
INSERT INTO `room` VALUES (157155833, '台北亚都丽致大饭店', '', 1, 8, '2022-12-15 16:10:55', '2022-12-15 16:10:55', '民权东路二段41号');
INSERT INTO `room` VALUES (158469437, '登喜来商务酒店(佛山南海九江信基广场店)', '本店坐落于西樵、九江的佛山城，酒店距离信基广场驱车只需3分钟，步行只需15分钟，驱车半小时可到沙堤机场，驱车25分钟可到佛山火车站，，距离3公里到达龙山高速口；酒店周边覆盖产业丰富，学校教育资源有九江中心小学、九江上东小学、九江中学、南方小学、九江镇初级中学、儒林一小、佛山九江英华幼儿园、九江学校、南海区九江职业技术学校。景区和公园有朱九江先生纪念堂、九江侨乡博物馆、红棉公园，探花公园，盈信广场。交通枢纽有九江大桥、沙堤机场、龙山汽车客运站、佛山九江定安货运码头、西江，医疗和其他资源有南海区第九人民医院、九江科技园、九江敬老院等。\n酒店是一家中式商务酒店，大厅配备休闲区宽敞明亮，使您进入酒店顿感轻松愉悦，酒店拥有各类型豪华客房，其中汗蒸主题的休闲客房是我们酒店的特色，拥有私人空间的休闲放松，扫去疲累回归轻松。酒店餐厅各色各样的早餐品种可供选择，荟萃中西精美菜肴，给您味蕾上的体验，除此以外酒店拥有停车场，让您的爱车拥有的停靠。\n酒店致力于提供高休息环境和服务，让您在旅途中能够体验宾至如归的感觉。商务酒店期待您的到来！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区九江镇奇腾路19号（近信基广场、龙山汽车客运站）');
INSERT INTO `room` VALUES (159390340, '君临海景假日酒店', '本店位于沙扒湾海滨大道，距离月亮湾5公里，沙扒湾10米之遥。酒店是一间按标准设计、建造的度假酒店。酒店拥有各式舒适海景、山景  客房：豪华大床房、豪华双床房、亲子房、家庭套房、主题情侣圆床房，日式房；家庭套房有客厅厨房有电磁炉电饭锅可供客人烹饪；24小时热水，10秒速热 ；WIFI覆盖整个酒店，让您随时享受网上工作与娱乐；酒店设有餐饮部，二楼豪华包间，三楼豪华大厅，承接酒席宴席，全落地玻璃的奢华装潢，一边享受美 食，一边看一望无际的海景，听海浪的声音，令人心旷神怡；餐饮部主打生猛海鲜，广东美食，设有粤式早茶、夜茶和中餐、晚餐。酒店还有停车等设施，为 顾客提供完善的食、宿、娱乐及交通通讯服务。酒店随时为尊敬的宾客提供热情细致的服务，期待着您的光临。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县海滨路1号（近海角三号，沙扒湾）');
INSERT INTO `room` VALUES (160322273, '维多利度假公寓(海陵岛十里银滩店)', '本酒店公寓位于广东省阳江市海陵岛十里银滩中心点，毗邻景区“十里银滩”，每一间房坐拥一线海景：公寓装修风格独特，房型位置靠近南海一号及海滨浴场，紧怜海边中心点。  公寓别具一格的豪华多种风格，多变的房型。优选一线海景，让每一个过来游玩的客人体验中国醉美海岛蓝天白云，公寓周边景点，特色小吃，餐馆，百货商店样样俱全。温馨舒适，醉美海岛欢迎您的到来。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利银滩P区3栋1楼（近十里银滩,距海滨浴场120米）');
INSERT INTO `room` VALUES (160711664, '麗枫酒店(广州融创文旅城店)', '本店位于广州市花都区建设北路201号，毗邻融创文化旅游城，花都人民公园、花都区政府，伯乐购物广场、大型家具装饰城，骏壹万邦商场，永旺国际连锁超市，来又来商场等。酒店交通便利，紧邻701、701A、715路公交 途径：车辆厂技校站下；紧邻地铁9号线“花都广场站”。\n      周边景区：洪秀全故居，花都香草世界，石头记，曼谷园，圆玄道观，九龙湖度假区，王子山森林公园，芙蓉嶂，资政大夫祠、等知名景点。\n\n周边学校：广东行政职业学院，广东第二师范学院，广州工商学院，雅居乐中学，圆玄中学，黄岗中学。\n\n酒店是铂涛集团倾力打造以天然香气为特色的舒适体验型连锁酒店，酒店各类客房均配有慕思床垫、空气净化系统、房间智能化控制系统（电动窗帘、淋浴音乐、蓝牙）、大屏幕液晶数字电视、迷你吧冰箱、特质香氛洗护用品、高速无线wifi。酒店配套休闲吧，为每位客人提供精致的下午茶，是您商旅、洽谈、会友的好去处。铂涛集团加入【阳光诚信联盟】，作为铂涛集团旗下的中端连锁品牌，与您阳光同行，诚信经营。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '花都区建设北路201号（原华夏娱乐城，近区政府）');
INSERT INTO `room` VALUES (163461315, '沐澌汀酒店(广州龙归金铂广场店)', '本店是一家现代时尚轻奢精品商务休闲酒店。 酒店秉承“打造臻至酒店精品，完成国民酒店蝶变”的经营理念，提供轻奢时尚安心酒店产品，专心舒心高品质服务理念。 酒店座落于广州市白云区太和镇龙归南岭翕和大街3号处，毗邻金铂广场、白云机场、龙归地铁站，竹仔园公交车站，交通便利，酒店建筑面积4000多平方，楼高六层，拥有各种房型。客房采用智能化客控系统，立体环绕北欧松林style轻音乐，让您亲临其境，营造整体轻松的舒睡环境，享有独立WIFI、网速快，全景窗户、品牌卫浴、舒适用餐环境，多样自助早餐、会议室等。“人生理享家”——是我们服务的缩影更是回归酒店的初心，我们将热诚的“正能量”浇灌到每一位员工，萌发出一颗颗友爱的心，用这份爱心为您创造温暖和快乐，给您在旅途中得到充分放松及汲取精神养分，感召每一刻简单的舒心！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '白云区鹤龙三路93号（近龙归地铁站、金铂广场）');
INSERT INTO `room` VALUES (164401647, '乐在旅途度假优选酒店(敏捷黄金海岸店)', '酒店被热带绿荫环绕，设有专用的海水泳池池和超五公里长私家海滩，公寓步行几分钟即可到达海滩，还有趣味分呈的水上乐园。酒店住宿 环境宽敞明亮，南北通透，面朝大海，房型丰富多样，例如鸟语花香露台大床房，海景露台卡通亲子主题双床房，小资情怀浪漫情侣大床房等多种房型，配套 设施齐全（空调、热水器、电冰箱、洗衣机、电视，热水壶、电吹风，衣柜、梳妆台、沙发、抽油烟机等）。周边有沙滩俱乐部、1公里奇迹般的透明水晶湖  、海上运动中心、酒吧街、室内儿童乐园、高楼彩虹灯光秀等配套设施。酒店毗邻景区“十里银滩”、南海一号博物馆，交通便捷，环境优美，是您旅游度假的 理想选择，我们在这里恭候您的到来！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛敏捷大道敏捷黄金海岸35栋206室（距敏捷黄金海岸沙滩88米、敏捷风景酒吧街58米）');
INSERT INTO `room` VALUES (165195592, '阳江海陵岛慵懒海景度假酒店(十里银滩店)', '公寓由敏捷集团斥巨资精心打造，内部摆设精致，风格简约不失温馨，柔软的床铺、干净的洗浴间，都让人身心放松。打开窗户，拂面而来 的是清新的海风，你能看到外面无边的海景和美丽的园景。\n　　\n　　悠闲的午后，你能在茶室、棋牌室消磨时光，或是前往沙滩晒日光浴，享受浪漫、美好的假期。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇敏捷大道敏捷黄金海岸聚龙湾35栋2楼（距离十里银滩80米、风情酒吧街50米）');
INSERT INTO `room` VALUES (166746036, '海寓度假酒店(敏捷黄金海岸海陵岛闸坡十里银滩店)', '海寓度假公寓（敏捷黄金海岸店）坐落于阳江海陵岛敏捷黄金海岸，5万㎡水晶湖乐园，乐园拥有超万平方米的无边际泳池，淡水泳池、缤  纷儿童池、儿童水寨以及水上游乐等设施。这里拥有湛蓝的海天美景，原生态绵长的沙滩，透明清澈的海水以及瑰丽的双湾风光。\n公寓整体装饰如家般温馨雅致，分为欧式、东南亚、地中海三种风格。客房舒适洁净、宽敞明亮，海景房拥有独立阳台，可将碧蓝辽阔的海景观尽收  眼底。公寓拥有各类房型套房，可以简单家庭适合眷侣及家庭游客入住。房内配置空调、液晶电视、24h热水、独立卫浴等设施，满足宾客日常生活所需。周  边生活设施齐全，便利店、公交站、农贸市场、特色茶市、海边餐厅。让您体验海景度假舒服的公寓住宿。\n生活无需别处，海景生活在这里。毗邻景点南海一号博物馆，红树林湿地公园，十里银滩，等您来一次轻松愉悦的滨海的滨海度假生活。领略阳光、  沙滩、海风的乐趣，是旅游度假的理想胜地。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛敏捷大道敏捷黄金海岸2座112室（近敏捷水晶湖）');
INSERT INTO `room` VALUES (167413795, '朝海海景度假公寓(阳江沙扒月亮湾滨海国际旅游度假区店)', '欢迎您的下榻，我们将竭诚为您服务！', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇碧桂园月亮湾度假区椰林路金兰湾2栋406（近海滩）');
INSERT INTO `room` VALUES (169002296, '维也纳3好酒店(广州机场路万达广场店)', '本店位于广州市白云区机场路28号（怡发国际广场旁），地处广园中路与机场立交交界处，地理位置优越、交通便利；距地铁2号线飞翔公园站B出口仅1公里，紧邻沈海高速广州支线和机场高速，距广州火车站、广州体育馆、白云国际会议中心仅10分钟车程；距白云国际机场、广交会展馆、广州东站仅20分钟车程，广州南站30分钟路程；旁边商圈有大型怡发、兴发化妆品批发广场、汽配城、白马服装批发城、壹马服装批发城、红棉服装批发城、广州流花服装批发城等大型服装、鞋帽批发广场，以及的皮具批发商圈，白云世界皮具贸易中心、亿森皮具城、金亿皮具城、O2O国际皮具城、时畅皮料采购中心等大型皮具及辅料批发中心；近五号停机坪，白云万达广场、沃尔玛购物等大型生活购物场所；距广州中医药大学附属医院、省妇幼保健院仅3分钟车程；毗邻白云山风景区、雕塑公园、三元里抗英纪念碑、白云湖、越秀公园、中山纪念堂等名胜景点；酒店采用酒店品牌特色（好环保、好洁净、好健康）风格设计，设有舒适优雅的各式客房。无论是您商务公干、外出旅游或是参加展会，您都能享受到酒店带给您的尊贵体验和愉悦享受，是您休闲旅居和商务洽谈的理想之地。\n快捷的位置优势:\n近广州中医药大学第壹附属医院、广州火车站、白云万达、怡发和兴发化妆品批发市场、三元里皮具城、广州城市置业学院（广州南校区）。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '白云区机场路28号（近怡发广场、广州中医药大学第一附属医院）');
INSERT INTO `room` VALUES (169093448, '海陵岛敏捷海滩假期度假公寓', '房屋配有落地窗，品牌家电，豪华型床品，由房东亲自设计的主题房间，无论是公私差旅还是亲朋小聚，都能感受同样温馨的体验，相信会 给朋友们留下温暖美好的回忆！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛敏捷大道敏捷黄金海岸01栋3楼08室');
INSERT INTO `room` VALUES (169099602, '阳江海陵岛北洛秘境度假酒店', '酒店位于广东省阳江市海陵岛闸坡镇国际旅游度假区内，毗邻大角湾风景区。\n酒店三面环山，南面临海。珍珠白沙滩海水清澈、沙质幼细，踏浪戏水、尽情畅泳，欢欣雀跃；沙滩旁八公里长的滨海栈道环绕园区内的山体公园。 近听浪涛拍岸、远赏朝晖晚霞，悠闲惬意。\n酒店顶层设有无边际泳池，仿若“悬停”于天际的巨轮，视野开阔；位处园区山体公园上的悬崖泳池别具一格。\n酒店装修风格具有岭南中式特色，轻奢别致。海景豪华房、秘境豪华房等多种房型满足不同宾客的居停需求。\n位于酒店首层的秘境餐厅临海而建，景致迷人。在此用餐，心情与味蕾一同得以叹享。各种星厨精制出品令各方宾客可大快朵颐。\n同在园区内的顺峰餐厅、美食街以多种不同特色的出品满足宾客不同的口味。\n园区内的多功能宴会厅、会议中心、儿童乐园、商务及旅游服务中心、便利店、棋牌室等多种游乐配套设施令宾客可欢享丰富多彩的假期。\n酒店委托励进酒店集团管理，以客为重、以人为本，旨在为各方宾客打造休闲度假的优选之地。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛秘境国际旅游度假区内');
INSERT INTO `room` VALUES (169321788, '宜尚酒店(百利广场漠江路店)', '本店隶属于东呈国际集团旗下主力中端标准商务酒店品牌，倾力打造以优选餐饮、立体沐浴、高质睡眠、隐形服务、自助洗衣、自助健身房 、WIFI覆盖等先进的设施设备、配套齐全，为投资者与顾客带来高性价比的优质住宿体验。酒店坐立于阳江市中心漠江路130号，近石湾南路步行街、东岳公  园、百利广场和各类商铺。距海陵岛、闸坡仅40公里。另市区周边密布马尾岛、东方银滩、北洛湾、珍珠湾、凌霄岩、大角湾、沙扒湾等海滨温泉景点。酒店 拥有各类客房，独具特色的商务社交住宿空间、时尚、灵活、宽敞，是您商旅、洽谈、会友的好去处。让追求不凡的你专注前行。东呈国际集团是一家旗下共 有15大酒店品牌的酒店集团。目前，集团旗下拥有超过3000家酒店（含筹建），客房数超过24万，分布于全球200多座城市。\n宜尚酒店是东呈旗下以\"轻文化\"为产品和服务特色的标准中档酒店连锁品牌，传承北欧精致、简约以及品质风格，致力于为路过旅人和出差人群提供  充满幸福感的差旅体验。宜尚酒店的幸福设计包括有着舒适弧度的欧式桌椅、开放式的沐浴空间、蓬松柔软的床品物件，这些元素的搭配组合为宜尚酒店营造 了享受的居住空间，给每一个消费者提供优质的服务，舒适的环境，更加实惠的价格。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区漠江路130号（近百利广场、市政府）');
INSERT INTO `room` VALUES (170608799, '阳江敏捷黄金海岸海景海边度假别墅公寓', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛敏捷大道敏捷黄金海岸悦海湾43栋');
INSERT INTO `room` VALUES (170651174, '后客智慧酒店(广州增城新塘地铁轻轨站店)', '酒店地处新塘核心商圈，海岸城市广场和星之岛广场双商圈。\n【交通便利】距离新塘地铁站、轻轨站、高铁站600米，机场大巴100米。\n【停车】配套地下停车场、露天停车场，车位充足。\n【酒店周边】金海岸广场、星之岛广场、太阳城、动力广场、新塘广场、碧发广场。\n【酒店周边景点】古海遗迹、瓜岭碉楼、湛淮德祠、湛横云墓、天下士祠等。\n【酒店周边美食】酒店百米以内，各种美食，日料、火锅、湘菜、川菜、顺德菜，一应俱全。\n【酒店特色】酒店以艺术为主题，专业设计团队打造，总体现代偏雅奢，又融入了广式传统元素精髓，清新宁静；大气优雅。\n保养很新但已经不存在装修的味道，正是适合入住上上佳时段；没做过隔离酒店，可放心入住。\n大堂吧挑高9米，大气而精致，十分适合商务浅洽、等待小憩。空中花园及长廊，休闲、商洽、会友把诗，在喧闹的城市给客人带来一份惬意的休闲、商务空间。\n无黑房，全部客房有窗，窗外有景。\n【设备设施】中央空调，自动恒温，人体舒适度高，保持水分皮肤不干燥。所有房间安装新风系统，24小时室内外新鲜空气互换。24小时热水，打开水龙头，热水1秒即到。专业睡眠床垫，完全按照人体工程学专业打造，软硬适度、怎么睡都不累；优质床品，按高端标准配备，巾类更是进口纱线织造，亲肤贴合，体感美好。背景音响、智能马桶、WIFI，宽带，舒适办公桌椅，沙发、长榻或长或短、或坐或卧。无论商务出差、居家旅行、走亲访友，本店全体同仁随时做好准备迎接贵客光临。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '增城区新塘镇新新大道南32号（近新塘地铁站）');
INSERT INTO `room` VALUES (170713780, '星光国际酒店(长沙高铁南站店)', '酒店位于长沙高铁南站正对面金轮星光名座商圈七栋117门面，紧邻地铁口，距离高铁南站步行6分钟，酒店结合设计师全新的设计理念，采用高端创新的设计方案装饰风格和布置细节，优质诠释了耳目一新的个性化理念。从而让身在觅恋的体验变得犹为舒爽、舒畅。本酒店设有十几种不同风格的各类主题房，欧式大床房，畅享影院房及商务大床房，相信一定会可以给您带来独特不同的入住体验！\n【交通便利高铁】距长沙高铁南站仅931米，步行6分钟可达，酒店有接送服务；\n【交通便利地铁】距2号线杜花路站260米，距4号线平阳站430米，步行三分钟可达；\n【交通便利公交】距公交车站即长托站公交车站50米，\n【酒店硬件】畅享中央空调，无线WiFi，全天候24小时热水, 高清数字电视，高清投影设备，客房提供洗漱用品等等。\n【接送服务】酒店提供高铁站及附近地铁站专车接送服务。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '雨花区湘秀路131号金轮星光名座7栋117号门面 （近高铁站西广场，杜花路地铁站）');
INSERT INTO `room` VALUES (171868687, '阳江海陵岛敏捷黄金海岸语岸度假酒店(十里银滩店)', '酒店座落于广东省阳江市海陵岛。酒店毗邻景点-敏捷海岸景区，景区內有一个面积达5万平方米水晶湖，设有海水，淡水泳池和海滩，以及 趣味分呈的水上乐园，公寓每间客房都可将银滩海岸风光尽收眼中。有特色的客房都配备有空调和房间内高速上网，让您感受到更加贴心细致的入住体验。电 热水壶可供使用，便捷的客房设施定能让您倍感舒适。除此之外，配备有拖鞋、24小时热水和吹风机的浴室是您消去一天疲劳的好地方。餐厅方面，酒店为旅 客提供种类繁多的选择，包括中餐厅、西餐厅和日式餐厅，让您可饱尝各色佳肴。您可以在大堂吧点上一杯，在优雅的氛围中小酌一番。贴心的送餐服务可以 满足那些喜欢在私人场合进餐的旅客。酒店的健身设施有室外泳池。酒店设有会议厅，为旅客提供高品质的商务服务。24小时开放的前台服务可为您随时提供 信息，以帮助您探索这个魅力之都。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸聚龙湾35栋1楼111-113室（距十里银滩100米，近恒大海上夏威夷）');
INSERT INTO `room` VALUES (174189886, '海陵岛保利银滩海尚度假公寓', '本公寓落于阳江市海陵岛保利海洋之心（海陵岛十里银滩中心点）毗邻南海一号博物馆！公寓每间客房都可将十里银滩风光尽收眼底。公寓 装修豪华，客房所有房间都有一个大阳台正对大海。公寓配有豪华独立淋浴房，开放式厨房，电冰箱，变频空调，24h热水供应，液晶电视，无线wifi等设备  ！给您一个温馨的居家感觉，欢迎您本公寓入住！', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛保利十里银滩海洋之心p区7栋');
INSERT INTO `room` VALUES (175273259, '铂菲度假精选酒店(阳江海陵岛十里银滩保利店)', '公寓位于海陵岛十里银滩中心点正对十里银滩  ，位置优越，紧邻海边，自然环境舒适宜人。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛保利大道保利海洋之心P区11栋03号商铺');
INSERT INTO `room` VALUES (177876977, '敏捷黄金海岸逸海湾酒店公寓', '酒店位于阳江市海陵岛聚龙湾，十里银滩一线海岸线就在眼前，满视野的蓝色，金灿灿的沙滩围着大海，站着酒店房间阳台上，几乎将所有 的风景都敬上。\n海景双床房均是2021年装修的，现代地中海风格的搭配房间舒心舒适，每间客房阳台的景观五万方水晶湖一线海景尽收眼底，尽情享受大海无尽的风  光冲击，酒店周边西南方向就是中外驰名的海陵岛十里银滩旅游度假区(距酒店5分钟车程)，东边方向是红树林湿地公园（距酒店5分钟车程），入住本酒店公 寓是您畅游海陵岛不二的选择，本公寓全体人员恭候您的到来！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道南敏捷黄金海岸聚龙湾35栋1层大堂（距海边100米）');
INSERT INTO `room` VALUES (179201046, '海斐·迎商酒店(广州新塘沙村地铁站店)', '每一场旅行都是不断探索发现、结识新朋友、感受新生活的过程。酒店以无限活力、独特个性为商务和休闲旅行者打造贴心的丰富体验。\n酒店处处洋溢着时尚和现代气息，从艺术色彩的运用，到充满创意的装饰设计，每一细节都令人感到新奇和惊喜，令宾客尽情享受精彩和惬意。拥有多间客房。一楼为酒店大堂，二、三楼为沐足，棋牌。4~7层为酒店客房，集住宿与休闲娱乐为一体。现代潮流的客房设施、清新高雅的大堂环境，经典高端的会议设施及专业细致的服务，使酒店成为名副其实的身聚、心聚之所。\n酒店坐落在新塘大道一侧、距离沙村地铁站边（C2出口）直走，步行仅需7分钟。距离新塘三中公交站仅370m，步行约5分钟，出行便捷。购物中心有：新塘广场约3.8公里，打车11分钟即达；餐饮：酒店附近有音乐酒馆、湘菜馆等，步行约3分钟即达；如您需要吃喝玩乐一体有：金海岸城市广场、汇太广场（左右两边相邻）约4.5公里，打车15分钟即达，1~3层建议购物，4层以餐饮、娱乐为主，各种主题餐厅（如：机器人主题餐厅、太空舱主题餐厅等）海底捞火锅、胡桃里、日式餐厅、猫屎咖啡、一点点等，广州耀成龙国际影院，美好的一天全都给安排上啦。\n人生是一场不会停止的旅行，愿我们能参与你的旅行，成为你停靠的港湾，给你家的温馨，小迎期待您的宠幸！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '增城区新塘大道西644号（距沙村地铁站C2出口670米）');
INSERT INTO `room` VALUES (179674820, '北极光自助酒店(天河智慧城地铁站店)', '本店位于广州市天河区东北部天河智慧城（IBD）的核心区。距离广州天河城、正佳、太古汇等商圈约25分钟车程，距离文艺基地红砖厂、沙面、小洲村约25分钟车程，距离琶洲广州国际会展中心、海心沙、广州塔约20分钟车程。\n交通情况：【交通路线】广州南站—五山地铁站——民宿:五山地铁站B1出来过对面搭78A路，在华农大正门站上车搭8站到华观路中站直达小区楼下；白云机场—日航酒店下车，斜对面就是万科云城米酷(小区楼下)；公交车站：华观路中站（小区楼下）；近的地铁站：21号线智慧城站B出口下车，步行约7分钟左右，拼车约5分钟到达；拼车：可以输入“万科云城米酷”，选择万科云城米酷下车即可看到B5栋；广州东站——民宿：广州东站搭1号线3个站到杨箕站，杨箕站换乘5号线5个站到员村地铁站，换乘21号线到智慧城B出口出来拼车约5分钟到达；天河客运站——民宿：乘坐地铁6号线5个站在高塘石站B出口下车，拼车约8分钟到达。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '天河区新岑四路万科云城米酷B5栋负1层112铺（近天河智慧城地铁站、岭南学院）');
INSERT INTO `room` VALUES (180561950, '趣墅度假别墅(阳江敏捷黄金海岸店)', '本店坐落于被誉为“十大美丽海岛”之一的阳江海陵岛，毗邻“大角湾风景区”，自由岛旅游度假区、南海1号博物馆、马尾岛、北洛湾风景区  等知名旅游景区。8万平方米水上娱乐城“水晶湖”亦距离别墅不远，您可以在无边际泳池尽情畅游，也可以去体验丰富的水上游乐项目，共赴一场狂欢之约。  \n　　入住您可以自在憩于海景别墅，或是躺进精心打造的主题别墅，感受大海的呼吸。别墅内有多间客房，结合自然风景和现代家居，充分的利用每  个空间，满足都市人的生活趣味。每个房间均使用高级的床上用品，保证您的睡眠质量；设施齐全的家庭厨房，可助您一展厨艺。 \n　　全国的别墅度假品牌。作为“趣味度假魔法师”的首倡者，希望为客人带来有趣而美好的度假体验。无论是家庭度假、亲友聚会、公司欢聚，或是  商务接待等，都能为你提供理想的度假地。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸海心湾56栋03号');
INSERT INTO `room` VALUES (182636114, 'BEST国际公寓酒店(阳江海陵岛保利银滩店)', 'BEST国际公寓酒店(阳江海陵岛保利度假主题店)位于海陵岛保利银滩，堪称“第二个海南岛”的海陵岛核心地段，距银沙海滩百米之遥。 酒吧、KTV、餐厅、食街、便利店出门即到，生活十分方便，让你和家人、朋友享受一个轻松的惬意旅程，让你和爱人一段的度假浪漫回忆。 酒店为浓郁的地中海浪漫主题风格；在观海阳台上，你可尽情享受海风、海景，观赏日出与日落的浪漫美景，是家庭、朋友、同学、同事聚会，休闲度假，交流情感，放松心情，是现代都市人全新的海居。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利海上时光银滩K区4栋1楼（近保利大道高尔夫球场）');
INSERT INTO `room` VALUES (182725649, '格诺瑞斯酒店(长沙暮云生态动物园店)', '格诺瑞斯酒店创于2015年，成立以来，立足长沙，布局全省，面向全国，始终坚持“以人为本，互利共赢”的企业宗旨，为宾客提供支付市场同一价格水平的房费，就能享受到高品质设计装修风格的酒店设施、设备和优质的服务。格诺瑞斯酒店（暮云生态动物园店）是由湖南格诺瑞斯酒店开发管理有限公司管理运营,酒店位于暮云镇南托岭中心地段，地理位置优越，毗邻湖南省生态动物园、三只熊滑雪场，距离4A景区昭山仅十分钟车程，交通便捷，紧邻轻轨芙蓉南站和107国道，周边商业成熟，配套完善，是您商旅,休闲,爱情栖息的理想选择！酒店拥有商务房、影视房、棋牌房共65间，一间可以容纳60人中型会议室。酒店采用先进智能化中央空调、恒温热水系统、高清智能网络电视、高速WIFI、品牌床垫、将为您提供温馨、舒适、浪漫的休息环境和高效的优质服务！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区暮南中路110号');
INSERT INTO `room` VALUES (183979425, '阳江十里银滩铂蓝度假别墅(十里银滩店)', '本别墅，位于江城区海陵岛闸坡镇保利银滩B、C、E区别墅群，距离南海1号古船约500米，周边景色秀美宜人。\n这里客房宽敞舒适，别墅配有：KTV、冰箱、电视、厨房、厨具、wifi、停车位、24小时热水、24小时管家服务、独立卫浴等设施齐全，让你像住在家 里一样自在。\n周边美食、休闲、娱乐精彩纷呈，宾客出行便捷。入住于此，您可以放慢生活节奏，享受您的每一段自在旅程。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛保利大道保利银滩明月郡别墅群');
INSERT INTO `room` VALUES (185220347, '半山海景度假公寓(海陵岛海上乐园店)', '酒店位于海陵岛景区旁边的半山腰，地理位置优越，面朝大海。交通方便，附近1公里有多个热门景点。大角湾海上乐园、十里银滩、南海一号博物馆、天麓山顶公园、南海放生台和螺洲沙滩公园。\n楼下海滩可以赶海抓螃蟹，步行仅需5分钟！', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区闸坡镇海滨西路1号山海湾A区04栋1楼');
INSERT INTO `room` VALUES (187737621, '菲尔度假酒店公寓(海陵岛十里银滩店)', '位于海陵岛十里银滩的海景公寓，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们 ，在这里，等您来。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道保利银滩海洋之心P区3栋（近十里银滩）');
INSERT INTO `room` VALUES (188330240, '珑山林台北中和饭店', '', 1, 9, '2022-12-15 16:23:14', '2022-12-15 16:23:14', '中正路631号');
INSERT INTO `room` VALUES (189057695, '悦峰酒店(阳江漠江路百利广场店)', '悦峰酒店(阳江漠江路百利广场店)位于阳江市中心漠江路256号，是一家以人文生活为主打高性价比中高档商旅酒店，酒店客房101间，设有 高级房、雅致豪华房、品致豪华房、榻榻米大床房、观景阳台房、豪华套房、豪华亲子房等，悦峰酒店配有自助洗衣房，免费早餐，大型免费停车场等一系列 配套设施设备。\n【免费停车】酒店正门、侧门有大型停车场，并配有地下专用停车场车位共80个并设有大巴车位；\n【交通便利】位于阳江市中心主干道漠江路，距离市汽车总站8分钟车程，距离阳江高铁站约12分钟车程，距离阳江市区高速出口仅10分钟车程\n【酒店硬件】设有免费洗衣房、餐厅等，客房设有冷暖空调，免费提供电子产品充电设备，办公用品等；\n【光纤网络】千兆光纤网络，房间独立专线WiFi，保证光速上网体验；\n【行政中心】距离行政服务大厅只需3分钟车程；\n【酒店承诺】客房布草一客一换，提供一次性水杯等各种一次性用品、剃须刀等;\n【周边景点】距离5A景区闸坡大角湾风景区、北洛湾、保利、敏捷度假村、十里银滩、南海一号等景点约40分钟车程\n【娱乐购物】距离阳江市区百利广场约1公里，距离沃尔玛购物广场约1.5公里，距离天润广场约800米，临近石湾南路购物街；\n悦峰酒店全体员工真诚欢迎全国各地宾客光临！为您提供舒适，温馨的商务社交住宿环境。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区漠江路256号（人民银行东100米，距阳江市政府980米）');
INSERT INTO `room` VALUES (190717527, '域酒店(佛山碧桂园总部店)', '域酒店（佛山北滘店）座落于佛山市顺德区北滘镇碧桂园总部新翼广场。域酒店集团精心打造的一家休闲度假型.商务.会议酒店。毗邻长隆旅游度假区、长鹿旅游度假区，临近轻轨顺德站、碧江站、北滘站等。交通便利。酒店欧式装修，时尚高雅，拥有184间各类豪华客（套）房。域酒店（佛山北滘店）不仅传承了传统欧陆风格，还融入了西方流行时尚元素。结合旅游度假，商务出差，会务团体需求，为每一位宾客提供热情周到的服务，让每一位宾客感受到宾至如归的感觉。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '顺德区北滘镇碧桂园大道1号新翼广场3座1层A7（碧桂园总部斜对面）');
INSERT INTO `room` VALUES (190721115, '海季海王星酒店(海陵岛保利十里银滩店)', '本公寓落于阳江市海陵岛（海陵岛十里银滩中心点），毗邻南海一号博物馆！公寓每间客房都可将十里银滩风光尽收眼底。公寓装修豪华，客房所有房间都有一个大阳台正对大海。公寓配有豪华独立淋浴房，开放式厨房，电冰箱，空调，24小时热水供应，液晶电视，无线wifi等设备！给您一个温馨的居家感觉，欢迎您来本公寓入住！经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等着您。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利十里银滩M区2栋（距海边100米,海王星酒店同栋）');
INSERT INTO `room` VALUES (191441255, '寓上铂品酒店', '公寓位于永州市冷水滩区，毗连市体育中心与中邦世纪广场，与市政府，市委交接，位于市行政中心及商业中心，交通便利，停车方便，1到4楼是全永州的商业中心，有电影院，全国大型连锁超市卜蜂莲花等等，吃喝玩乐一站式服务。部分房间可以一览美丽的潇湘公园，还有部分房间可以一览湘永大道的繁华和优美的空中花园。\n项目位于永州CBD中心，酒店客房，全部自助式，房间设备设施齐全，配备厨房，洗衣机，冰箱于一体的公寓式酒店\n酒店设尊贵双人间，单人间，优享棋牌室等房间供您选择，出差旅行的理想之选。酒店给您家的温馨。\n本店您温馨的家。酒店全体员工竭尽全力为您及家人服务。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '冷水滩区湘永路258号中邦国际公寓1楼（近卜蜂莲花超市、体育中心）');
INSERT INTO `room` VALUES (191976990, '途家公寓酒店', '酒店定位于贴心式的智慧酒店，想您所享：把你想要的灯光、空调、窗帘“喊”出来；冲凉时，打开花洒，音乐自动响起，冲走一天的疲劳；有人来访，电视自动显示门口的场景，来访人员一目了然；智能起夜，无需摸黑；客房智能3D电影，让您畅享3D大片带来的快感；手机智能调控，将您手机里的内容投出来；一键情景模式切换，一切从“间”；场景式体验售卖空间，让您在客房即可实现购物、吃饭、旅游、特产一应俱全；智能客房特别推出：娱乐+智能的独特入住体验，一切以您为中心。为您提供舒适的居家环境，贴心的服务，给您家的感觉！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '蓝山县边贸南路117号');
INSERT INTO `room` VALUES (192288569, '悦峰酒店(佛山南海九江信基广场店)', '酒店毗邻西樵山风景区及国艺影视城，酒店地理位置优越，交通便捷，可轻松前往罗浮宫、顺联等家具卖场。酒店拥有现代化、智能化豪华客房，每间客房风格迥异,设计别致而独特。酒店设有多功能宴会厅配备视听会议设施。\n本店是您休闲度假、商务宴设之理想选择，个性化的设计为您营造一个舒适、静谧的私人空间。装饰豪华气派，环境舒适优雅，全体员工专业而贴心的服务，为每位入住贵宾带来非凡的感受。 酒店位于九江镇中心区，邻近325国道，地处佛山南海区、顺德区、高明区以及江门鹤山区四区交界之处，地理位置优越、环境优美；佛平高速、佛开高速均设有出入口，交通便利。酒店周边景区：西樵山、国艺影城、罗浮宫、龙江会展、亚洲材料城，盈信、龙涛湾、李小龙乐园。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区九江镇大正路北23号荣基嘉园大厦3层');
INSERT INTO `room` VALUES (193142492, '万季国际公寓', '本公寓位于佛山市狮山镇博爱中路68号长华国际商业中心商业1座23楼2306房。距离狮山火车站1.5公里，交通便利。临近长华国际广场、狮山体育馆、和信广场、奥园广场。位于锦绣华庭、锦绣北苑小区对面。本店有情迷地中海、法式商务风格大床房、现代清新大床房以及田园大床房等，热忱欢迎您的到来。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区科技北路狮山长华国际中心商业1座23楼2306房');
INSERT INTO `room` VALUES (193155350, '阳江海陵岛克洛伊度假酒店(敏捷黄金海岸店)', '本店位于江城区海陵岛敏捷大道海岸聚龙湾35号楼209房(距十里银滩100米，近恒大海上夏威夷)。经过一座城，寻觅一间房，消去您满身的 疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸聚龙湾35栋209房');
INSERT INTO `room` VALUES (193529233, '阳江瑞海金滩度假酒店', '酒店坐落于四季气候宜人，素有“东方夏威夷”之称的海陵岛闸坡，周边有马尾岛、十里银滩、海陵岛天麓山海旅游度假区、大角湾风景名胜 区等众多景点，前往北洛湾风景区步行即可到达，地理位置优越，让您的旅行轻松简单。\n酒店邻近海边，共有海景大床房、海景双床房、三床亲子房、三房一厅海景套房等多种房型供您选择，满足您的各种出行需求，非常适合家庭度假、  公司团建，让您在本店拥有别样的体验，开展一段难忘的旅行。\n酒店客房的装饰十分考究，每间设施齐全的客房都配备有空调、wifi。浴室内提供拖鞋、24小时热水和吹风机，让您感受到宾至如归的享受。房间的  独立阳台可以欣赏海景，窗外是大海的调色板，海风是温柔的明信片。另外酒店优美的环境，再搭配上细致周到的服务、酒店的休闲区定能满足您的品质需求 ，是您旅行度假的理想选择！', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛湾大道保利顺峰北洛秘境1栋');
INSERT INTO `room` VALUES (194629270, '海湾壹号海景酒店(海陵岛十里银滩水上乐园敏捷店)', '酒店位于广东省阳江市海陵岛敏捷海岸旅游度假区内，步行至十里银滩仅需2分钟，坐拥5.5公里原始海岸线，享受阳光沙滩的自然风光，不 仅有供孩子游玩的儿童乐园与丰富多样的水上乐园，也有新鲜刺激的水上娱乐项目任君选择。酒店临近红树林，恒大夏威夷，山底古村等名胜旅游景点。酒店 客房可欣赏一望无际的蔚蓝海景，均设有面朝大海或园林景观的独立阳台。客房设有开放式厨房、洗衣机，品牌家电家具，无论是公私差旅还是亲朋小聚，都 能感受到同样温馨的体验。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇敏捷大道敏捷黄金海岸聚龙湾35幢3楼330室（距十里银滩80米，近敏捷水晶湖）');
INSERT INTO `room` VALUES (194920442, '城市便捷酒店(佛山三水大塘店)', '本酒店佛山三水大塘店坐落在大塘镇大布沙半岛东路大塘中心广场，酒店采用简约、精致、时尚、绿色的设计风格，以“洁净、友好、舒适、便捷”为服务理念，酒店提供营养自助早餐、免费商务吧、免费自助洗衣、免费书吧、免费光纤WIFI、高弹力定制床垫及高密舒适淋浴。让您品味温馨、便捷、舒适，尽享超值体验。城市便捷酒店（佛山三水大塘店）是您度假休闲、商务出行的至佳选择！让您的旅行、商务一步到位，享受从容', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '三水区大塘镇大㘵沙半岛东路九号');
INSERT INTO `room` VALUES (195282202, '御尚然酒店(佛山梦里水乡店)', '酒店是一家高端豪华型酒店，酒店座落于佛山市南海区里水镇里官路28号，酒店设计优雅唯美，房间空间大，客房全部都是全景大落地隔音窗户，阳光透气，房间都配置有经过健康睡眠认证的专业床垫、独立WIFI、网络电视、迷你吧、自动窗帘等。周边餐饮、娱乐休息场所一应俱全。地理位置优越，酒店紧靠南方医科大学南海医院，附近有里水商业城，新天地广场。酒店有格调高雅的豪华客房，配套有自助早餐厅，早餐、水果、晚安牛奶。大小会议室及健身房，酒店以“主动、热情、耐心、周到”的经营理念为旅游及商务人士提供尊贵舒适的居住环境。 高端，雅致，专业，专注您的感受，用心服务。 酒店欢迎您！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区里水镇里官路28号（近南海花卉博览园）');
INSERT INTO `room` VALUES (195607638, '阳江海陵岛国瑞海景度假酒店(敏捷黄金海岸十里银滩店)', '公寓座落于广东省阳江市海陵岛敏捷海岸聚龙湾。酒店被热带绿萌环绕，毗邻景点-海岸景区，景区内有一个水晶湖，设有海水，淡水泳池  和海滩，以及趣味分呈的水上乐园，公寓每间客房都可将银滩海岸风光尽收眼中。公寓装修豪华，客房时尚高雅，不仅崇尚自然风格，又配有豪华公寓式酒店 的独立沐浴房，开放式厨房，电冰箱洗衣机等齐全设备，给您温馨的居家感受。\n公寓内有空调，24小时热水供应，液晶电视，无线网络（WIFI），床等设备，温馨舒适的家庭式服务，轻奢唯美的建筑风格，以及椰风金沙的银滩海  岸，是您到本店住宿旅游的理想选择。\n公寓周边景点，特色的小吃街，银行，超市，餐馆，当地特色小店一应俱全，你可以抛开繁忙紧张的都市生活，全身心的体验海岛生活。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵岛敏捷大道敏捷黄金海岸聚龙湾36栋3楼301房（距十里银滩150米，近恒大海上夏威夷）');
INSERT INTO `room` VALUES (195842828, '海之家海景主题公寓(阳西月亮湾滨海国际旅游度假区店)', '本店位于阳江沙扒湾旅游景区，碧桂园月亮湾景区内，公寓标配慕思床垫，海边沙滩，海上娱乐项目，滨海国际旅游度假区，月亮湾景区设 有公交站距离到沙扒镇是3公里，公交到阳西高铁站约30公里，公寓附近有大量停车位，附近有商圈，餐饮店，便利店等，公寓可选游玩项目、青洲岛来回船  票、浮潜、摩天轮、服务等，是您出行旅游，出差游玩的优选。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾椰林路碧桂园山泉海小区3栋106室');
INSERT INTO `room` VALUES (508058171, '时光格电竞酒店(东塘地铁站店)', '本店是长沙自营的连锁酒店，本店位于韶山路与劳动中路的交接处友阿百利大厦，东塘地铁口5号出口，近省中医附一医院，省儿童医院，雅礼中学，交通十分便利，楼下有友谊商城，大都市市步行街，潇湘影院，茶颜悦色，平和堂，步步高，各大商场齐聚，酒店风格以日式轻奢为主，房间空间大，有休闲的公共区域，整体环境好，本店以电竞为主，高端的电脑配置。专用的商务宽带，酒店24小时前台服务，酒店提供停车，指定停车场，可咨询前台。\n\n随时欢迎各位的亲临哦。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '雨花区砂子塘街道劳动中路2号友阿百利大厦25楼（近东塘地铁站4号出口）');
INSERT INTO `room` VALUES (517195146, '盛腾国际海景度假酒店(阳江海陵岛十里银滩店)', '公寓座落于广东省阳江市海陵岛万豪海陵湾1号，距离十里银滩300米。公寓装修豪华，客房时尚高雅，不仅崇尚自然风格，又配有豪华公寓 式酒店的独立沐浴房，开放式厨房，电冰箱洗衣机等齐全设备，给您温馨的居家感受。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇南海一号大道万豪海陵湾1号6幢5楼505室（距十里银滩200米,近保利飞行乐园）');
INSERT INTO `room` VALUES (522743226, '荣洋公寓(保利十里银滩店)', '公寓坐落于保利银滩P区， 经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 15, '2022-12-15 17:46:06', '2022-12-15 17:46:06', '江城区保利大道十里银滩西区P区P8栋301室');
INSERT INTO `room` VALUES (523769190, '诺曼海景公寓(阳江海陵岛大角湾店)', '【酒店位置】公寓位于广东省阳江市海陵岛闸坡镇大角湾海滨西路、海陵岛中心位置，是海上丝绸之路“南海一号”博物馆的必经之路，是海 景制高点，视野广阔；面向大角湾沙滩，步行几分钟即可到达沙滩，左边靠近放生台、东方银滩、南海一号，距离仅200米；距离闸坡镇海鲜农贸市场仅十分  钟车程。\n【周边500米内景点】①东方银滩（观海楼）：各大博主必打卡的景点，面向太平洋，观日出看海海陵岛机位。\n②景区大角湾景区：海岸线长、沙质上乘；拥有水上乐园、海滨浴场、及各种海上娱乐项目，为海陵岛知名度高且常去景区。\n③南海一号博物馆：海上丝绸之路起点，大宋古沉船很适合带小朋友去，很有教育意义。\n④南海放生台：情侣约会的尚佳点。\n⑤十里银滩、也仅仅五分钟车程。\n【附近美食】①好日子酒店是本地人常去的酒店。\n②正斗渔村喝早茶的好去处，推荐五星。\n③闸坡农贸市场购买海鲜可选择大排档加工。\n④各种网红打卡奶茶，网红小吃，一夜埕海鲜特产一条街尽在闸坡。\n【体验海滨小镇生活】步行几分钟即可到达大角湾螺洲海滨公园，音乐，沙滩，海浪声，街边小摊，一次更加融入当地的生活海滨度假体验。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇海滨西路1号山海湾度假村A4栋F层（近大角湾，水上乐园旁）');
INSERT INTO `room` VALUES (527890345, '听音海海景度假酒店公寓(阳江海陵岛十里银滩店)', '公寓座落于广东省阳江市海陵岛万豪海陵湾一号，距离十里银滩200米。公寓装修豪华，客服时尚高雅，不仅崇尚自然风格，现代大气，又配有豪华公寓式酒店的独立淋浴房、开放式厨房、电冰箱等齐全设施，给您温馨的居家感受。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区南海1号大道万豪海陵湾1号6栋402');
INSERT INTO `room` VALUES (550176031, '阳江十里银滩观景海边别墅', '别墅立于海陵岛十里银滩精华段，有海景房推窗可见的美丽海潍、三大世界原生态公园、亚洲跨海18洞高尔夫球场、亚洲大型水下考古博物馆、露天海滨浴场、帆船基地、风筝博物馆、登山道、风车顶、“秀魔方”等知名景点，成拱月之势，傲然而立。一、预订说明：预订别墅后会有客服人员联系确定入住地址如入住繁忙请耐心等待，或者主动联系客服人员咨询。二、房型情况：由于别墅风格繁多，且每套装修均不同，图片只能展示小部分房型，如无提前联系直接下单均默认为随机安排。三、门店定位：订房后请与客服人员联系获取具体入住房间的定位。无论是朋友聚会、公司团建还是家庭联欢，别墅都会满足你的需求！', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区十里银滩西区保利大道保利银滩j07栋');
INSERT INTO `room` VALUES (566462128, '夏沫海景度假公寓(阳西月亮湾滨海度假景区店)', '本酒店公寓位于阳西县沙扒镇“月亮湾海洋度假区”内，由于沙扒镇毗邻港口，所以享有“海鲜之乡”的美誉，各种海鲜的烹饪手法在这里全。 公寓周边享有唯美的自然风光、缤纷多彩的娱乐项目、步行即到的滨海浴场、网红沙滩打卡点及美食广场等娱乐休闲，而距离沙扒湾只需5分钟车程，吃喝玩  乐，一应俱全。公寓拥有多余间的客房数量，采用以大海为主题的风格设计，房间配备空调、24小时热水、液晶电视、无线网络等，室内还能观海聆涛，将连 绵16公里的海岸线一览无遗，，让您感受到“与海为邻”的舒畅感。管家式的贴心服务及完善的社区配套，让您充分享受舒怡宁静的假期。夏沫期待与你的相遇 ！', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道碧桂园月亮湾富力湾A3栋710房（近海滨浴场、冰雪世界）');
INSERT INTO `room` VALUES (574206502, '朵兰达酒店(长沙高铁南站店)', '酒店是美漾美居酒店管理有限公司旗下其中一个品牌。美漾美居酒店管理公司的企业文化-----服务就是生命，公司引进台湾保姆式酒店服务理念，拥有小管家的24小时管家式贴心服务。公司旗下拥有美漾轻奢，美漾.臻，美漾奢品，朵兰达doAland等品牌。由深造设计师精心打造，该品牌定位为中高端时尚摩登元素酒店，由大理石与玫瑰金时尚融合，在灯光的渲染下，营造出高雅奢华的氛围，客房拥有豪华高端的酒店设施，在这里一切的美好，时尚摩登。酒店前厅拥有提供咖啡奶茶粥类饮品的书吧休闲区，也有净氧洗衣房、烘干机，电脑以及复印打印机供贵宾使用。另外前台提供有针线包、精华乳液、洗面奶、感冒药、晕车药等一百多种生活便利品方便贵宾使用。在这里贵宾能真正体会：细细刷牙、慢慢洗澡、好好睡觉、静静生活，宾至如归。欢迎来到这里，我们等待着尊贵的您。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '雨花区黎托路绿地之窗20栋7楼');
INSERT INTO `room` VALUES (581826239, '尚客优品酒店(滨河路店)', '酒店致力于旅客更高品质的住宿需求。酒店主张雅致时尚、品质格调的场景化酒店空间设计，严选品牌用材、床品、洗护用品，配备便利的智能化设备，提供新零售、咖啡、书吧、自助洗衣等便捷的生活服务，营造美好舒适的出行居住体验。\n酒店位于湖南省永州市道县滨河路126-128号，县城中心城区临江位置，G道323河边大桥旁，离西洲公园周敦颐广场仅500米，距离繁华的九鼎商步行街，集购物、休闲、娱乐、餐饮于一体的步步高购物中心步行约5分钟可达，距离火车站车程约10分钟，距离汽车站车程约7分钟，配套齐全，交通便利。\n酒店有大床、双床、圆床、麻将房等多种房型，多种房型可选，酒店采用U5装修设计，房间内配有高速WIFI、液晶电视、24小时热水，独立卫浴，酒店还备有有早餐厅、停车场；酒店全体员工以专业的服务、热情的态度，期待您到来！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '道县滨河路126-128号');
INSERT INTO `room` VALUES (582861405, '品悦星辰酒店(五一广场步行街店)', '酒店主打轻奢潮流，现代简约，集成时下流行元素的设计风格，空间宽敞舒适，酒店主打高层全落地窗江景,城景房型。自然通风采光好，有多种不同种风格的巨幕高清投影房，时尚亲子闺蜜房，智能窗帘，灯控设施配套齐全，服务贴心热情，旨在为您创造一个温馨自在惬意的旅行环境。地处坡子街黄兴路步行街，IFS国金中心，解放西路酒吧一条街。高速光纤、独立WIFI、高清投影仪、智能投屏互动、乳胶床垫、自助洗衣机、冰箱等。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区坡子街与黄兴中路交汇处君临国际A座1单元27楼（距黄兴广场地铁2号出口80米）');
INSERT INTO `room` VALUES (586644084, '乐易住智慧酒店(广州嘉禾望岗地铁站店)', '本店位于广州市白云区嘉禾街鹤龙路（广州地铁嘉禾望岗站），地理位置优越，交通便捷，距离知名景区白云山约2公里，步行至嘉禾望岗地铁站约10分钟，周边娱乐及餐饮场所多。\n酒店按照高端标准打造，格调简约时尚，房间落地窗视野开阔。酒店将智能科技与舒适住宿结合，带来舒适、智慧的住宿体验。人脸识别自助入住快速便捷；智能门锁、智能4K电视、智能感应灯光、智能空调等智能设施；乳胶床垫、纯棉被单被罩、定制洗浴用品、商务办公桌、USB充电插口、WIFI覆盖等优质细节服务，为您提供一个智慧舒适的休息空间，是您出差旅游、情侣约会的理想下榻酒店。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '白云区鹤龙二路40号君天大厦6层（近金铂广场）');
INSERT INTO `room` VALUES (586826735, '粤塔H轻奢电竞酒店(海珠广州塔中山大学店)', '本店致力于创造年轻人轻松，快乐的入住氛围和优质睡眠空间，滨江店采用了现代化智能设备，使各位客官大大能够有更好的住宿体验.', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区下渡路788号之一锦骏华庭3楼（近鹭江地铁站B出口）');
INSERT INTO `room` VALUES (589052859, '阳江铂蓝度假别墅(敏捷黄金海岸店)', '别墅位于广东阳江市海陵岛敏捷海岸海心湾，坐拥迷人的海岛风光。毗邻知名景点—水晶湖、海滨浴场，前往阳江市区也十分方便。周边购  物、美食、娱乐等配套设施十分完善，让你的度假生活即便捷又舒适，你可以在无边际泳池尽情畅游，也可以去体验丰富的水上游乐项目，共赴一场狂欢之约 。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸海心湾69栋04户');
INSERT INTO `room` VALUES (589100128, '君澜海景度假公寓(阳西月亮湾店)', '本公寓位于阳西月亮湾景区内，临近沙滩以及月亮湾滨海国际旅游度假区，步行仅需3-5分钟，海滨沙滩活动区，设置海水浴场，海水浴场  参照国际评估标准，月亮湾浴场沐浴水平可与夏威夷、三亚市亚龙湾、阳江闸坡大角湾、阳江十里银滩相媲美，月亮湾还有沙滩足球、排球场、香蕉船、快艇 冲浪、小型飞机等项目，音乐主题晚会等活动。\n月亮湾拥有迷人的海岸线，这里沙白水清，不论是海滨漫步，还是冲浪、捡贝壳、看日出日落，都非常享受。月亮湾的海滩呈孤形展开，犹如一弯新  月落在南海之滨。海滩两侧峭壁高耸，礁石林立，风景十分优美。海滩上可以租借太阳伞，并设有海滨浴场，这里也是海上冲浪的好去处。游玩后，也可前往 沙扒镇品尝一顿海鲜大餐。\n\n我们君澜海景度假公寓周边也有神话乐园，除了海滩外，乐园对于亲子家庭出行也是个很好的去处，里面有很多机动游戏，像海盗船、小缆车、卡丁  车、碰碰车、旋转木马，还有冰雪世界、彩虹滑桥、真人CS、大摩天轮！！我们将以热情的服务，舒适的房间，期待您的到来，公寓客房设施齐全，房间干净 整洁，住宿舒适，房间配置空调，彩电等电器设备，有厨房及独立阳台，房间整洁明亮，服务人员热情大方，是去月亮湾度假值得选择的酒店，让你尽情享受 旅行的乐趣噢～\n\n酒店设施：\n客房设施：厨房、沙发、茶几、餐桌、冰箱、空调、电视、洗衣机、床及床上用品、床头柜、衣柜、台灯、wifi路由、吹风筒、晾衣支架、烧水壶、  水杯\n其他配置：拖鞋、牙具、香皂、梳子、沐浴液、洗发液、免费矿泉水、洗衣凝珠、毛巾、浴巾、纸巾、服务指南', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道月亮湾碧桂园月泉海C1区2栋102（近摩天轮、冰雪世界）');
INSERT INTO `room` VALUES (593727255, '蕉外民宿', '本店舒适干净卫生简洁艺术，欢迎入住，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区暮云街道万家丽南路高云小区东一区3栋2单元2楼');
INSERT INTO `room` VALUES (600269144, '浩海岛度假酒店公寓(阳江闸坡碧桂园北洛明珠店)', '酒店位于广东省阳江市海陵岛马尾岛入口处，是海滨度假型酒店。距离阳江市区50公里，经广湛高速或西部沿海高速至广州及珠各地仅需2-3小时，随着“海陵大桥”和高速铁路“深茂段”的开通，海陵岛将纳入珠地区一小时生活圈，前揽蔚蓝海湾大角湾，后倚天然绿肺大角山，背山面海，占据优良  的海景至高点，视野辽阔。酒店距马尾岛、北洛秘境、闸坡农贸市场仅约500米路程，游泳、钓鱼、购物的经过之路，只需3分钟车程；与景区马尾岛海滨浴场 仅200米路程。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇碧桂园北洛明珠2栋1楼106室（近马尾岛、北洛秘境国际旅游区）');
INSERT INTO `room` VALUES (600448358, '尚美假期酒店(阳江海陵岛闸坡碧桂园北洛明珠店)', '酒店位于闸坡镇大角湾景区内，周边设施齐全，临近马尾岛，大角湾等景区，交通便利，经过一座城，寻觅一间房，消去您满身的疲劳，酒 店房间设备齐全，具有独特的装修风格，房间内均有视野广阔的阳台，可观海景，日落等美丽的景色。我们将以热情的服务，舒适的房间，期待您的到来。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛大道199号碧桂园北洛明珠花园2幢1层109室');
INSERT INTO `room` VALUES (610393752, '城市便捷酒店(阳江百利广场市政府店)', '酒店位于广东省阳江市江城区东风二路52号，交通便利、地理优越，周边生活配套设施齐全。酒店装修沿袭城市一贯的简约、时尚风格，设 有多类客房可供选择。客房内设有24小时热水、独立卫浴、电视、空调、光纤、WIFI覆盖等，设施齐全。 酒店配备有自助餐厅、自助洗衣房、自助商务吧、  书吧等设施，是您商务旅行、休闲娱乐的理想下榻之地。 酒店周边购物及旅游地，距离知名旅游海滨闸坡仅40公里，距离全国咸水矿温泉40公里（阳西咸水  矿温泉），距离山水园森城阳春仅45公里。周边购物广场，百利广场500米，沃尔玛350米，大润发700米，鸳鸯湖2公里。距离阳江汽车站4公里，距离阳江高  铁站3公里。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区东风二路52号（近百利广场、名扬广场）');
INSERT INTO `room` VALUES (616141258, '嘉悦度假海景酒店(阳江闸坡碧桂园北洛明珠店)', '酒店地理位置佳，邻近大角湾，交通便利。经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到 来。我们在这里，等您来。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛湾大道碧桂园北洛明珠2栋1楼112号（距北洛秘境国际旅游度假区400米，近马尾岛）');
INSERT INTO `room` VALUES (627467176, '惜忆海景度假公寓(阳江月亮湾滨海国际旅游度假区店)', '位于碧桂园月亮湾度假区内，环境优美，客房内设施齐全，阳台能看海景，欢迎入住。\n经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道滨海度假区富力湾小区A1栋101室（近海韵广场、游泳场）');
INSERT INTO `room` VALUES (636239261, '阳江海陵岛北洛秘境洛悦酒店', '酒店位于广东省阳江市海陵岛闸坡镇国际旅游度假区内，毗邻大角湾风景区，酒店三面环山，南面临海。珍珠白沙滩，在这里看看人间烟火 ，浩瀚星空，落日余晖和海浪。约8公里临海栈道，山体公园，悬崖泳池，网红打卡点，近听浪涛拍岸、远赏朝晖晚霞，悠闲惬意。酒店拥有客房和套房，简  洁的现代线条和轻奢设计相得益彰，部分客房含有270度观景阳台，饱览浪漫海岸的美景，配有洗漱用品及舒适床品等设施。悦享餐厅拥有华丽的空间布局，  提供特色美食与精美茶点，既能在此休息，又可在此进行商务社交或休闲度假。顶层的天际品味餐厅，与无边天际大海相邻，揽270度望海视野。可在此尽享  由厨师臻选新鲜优质食材，精心炮制的环球美味与本地特色菜肴。在星空吧吹着舒适的海风，无论是开怀畅饮还是怡情小酌，都可以暂时忘却时间，尽情享受 假期的悠闲时光。童乐缤纷世界，拥有丰富多彩的儿童水上娱乐项目，为宾客打造一段难忘的亲子时光海湾泳池，无边际泳池是情侣享受浪漫二人世界的空间 。沙滩、海岛，享受悠闲时光。270度悬崖泳池，坐南朝北，北倚山恋，迎着柔和的海风，投入到海与天的怀抱。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛湾大道北洛秘境国际旅游度假区内');
INSERT INTO `room` VALUES (642858555, '网佳电竞酒店', '酒店房间配置高端的电竞电脑设备，可以畅玩各种游戏，高级的视听享受，舒适安逸的酒店房间。\n【酒店位置】：本店位于阳江市主城区江城区西平路77号，酒店别具一格，客房雅致、温馨。\n【酒店设施】：酒店周边有停车位。\n【酒店周边商圈】：酒店处于百利广场商圈，距百利广场约300米。\n【酒店周边车站】：酒店地处阳江中心西平路，门口即是平湾路公交站，距阳江汽车总站约2.8公里，阳江高铁站7公里。\n【酒店周边景点】：距闸坡海滨旅游风景区、阳春等旅游景区仅30分钟车程。\n【光纤网络】wifi覆盖、百兆光纤网络。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区西平路77号大堂2号台');
INSERT INTO `room` VALUES (651794564, '美利度假公寓(阳西沙扒月亮湾景区店)', '本店坐落在月亮湾，月亮湾是指广东省阳江市阳西县沙扒镇南海之滨一个美丽的海湾。步行8分钟就可以到沙滩，泳场。其环境优美，是多  层次、复合型旅游度假区，国家海洋公园风景区内，可以潜水，咸水矿温泉洗去一天的疲惫，本公寓提倡绿色环保特色，设备齐全，每一间房设置阳台，高频 网络。酒店小区内下楼就有停车场，同时也有地下停车场，为您出行带来很大的方便，为您打造一个舒适的休闲环境。我们期待您的到来。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道碧桂园月泉海E4栋104');
INSERT INTO `room` VALUES (670954874, '璞悦·江景轻奢酒店(五一广场店)', '本酒店地处繁华的五一商圈，坐落在迷人的湘江边上，让您出则尽享繁华，入则细品湘江的宁静。酒店楼下就是长沙非常出名的湘江风光带！离培元桥地铁站和文昌阁地铁站也是近在咫尺。去五一商圈不到十分钟路程。可以品味太平老街和坡子街的古朴，也可以逛遍黄兴路步行街的热闹非凡！品味长沙当地美食！更可以体验一下解放西酒吧一条街的狂野奔放！坐在酒店就可以观赏长沙非常美丽的湘江美景！橘子洲头!岳麓山景区！任江风拂面！思绪飞扬!作为旅游城市！本酒店是您的优选！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '开福区通泰街街道湘江中路一段168号大地金墅大厦718室（近五一广场、湘雅附一）');
INSERT INTO `room` VALUES (702467655, '佛山友逸假日酒店(梦里水乡店)', '友逸假日酒店（梦里水乡店）位于资源丰富的佛山市南海区里水镇朝阳路40号（振兴路交汇处），坐落于胜利商厦，紧邻梦里水乡百花园景区，毗邻广州，距广州国际新机场，广州南站，广州火车站仅需40分钟；距佛山市中心20分钟，佛山西站30分钟，里水客运站近在咫尺。里水镇内广佛高速公路、佛山一环快速干线、珠二环高速公路、广州华南快速干线第三期以及其它纵横交错的公路干线构筑了完善的交通网络，交通便利。\n酒店拥有各式主题客房63间，每间客房都为顾客精心配备纳米高科技高标荞麦枕、鹅绒枕与愉梦床垫，全自动配套蓝牙影音播放，确保您拥有舒适睡眠享受，以及提供独立空调、IDD直拨电话、数字电视和免费宽带，无线WIFI上网服务，环境优雅，各类设备齐全，可谓独具匠心，商旅佳选。附设餐厅、停车场等配套设施。周边商圈林立，大型的购物广场：信和广场、里水新天地，汇聚人口的商业街：沿江路、朝阳路、振兴路、文化街，中心学校，三甲医院，四大银行，大型商住楼等汇聚于此，附近还在各大工业区：大粒沙工业区等一应俱全。周边旅游景点有里水旅游小镇核心旅游景区—梦里水乡、西华古寺、佛山南海影视城、佛山南国桃园等，是您商务、休闲、旅游的上佳选择！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区朝阳路40号胜利商厦1楼');
INSERT INTO `room` VALUES (713428122, '墨客悦庭酒店(长沙涉外经济学院店)', '本酒店位于高新区麓谷核心地段，涉外经济学院北门西侧天元七彩商业广场。地理位置佳，交通便捷，酒店客房拥有多元化的布局，客房均设有空调、投影、电视、网络。并配套提供会议室、洗衣房、健身房等。是您办公、商务、旅游的上佳下榻场所。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '岳麓区文轩路天元涉外景园B区4栋1层');
INSERT INTO `room` VALUES (719548242, '顺祥·玺庭酒店(祁阳高铁站店)', '本店由资深酒店设计公司进行设计，设计灵感来源：酒店位于湖南省西南部，鱼米之乡的腹地，湘江中上游，永州东北部，因地处祁山之南、浯溪而得名的祁阳。设计师将属地文化元素文昌塔、祁阳石、祁阳戏剧糅合古建筑、藻井等地域元素贯穿空间设计之中，通过巧妙的构思、抽象化、艺术化、装置化，结合现代审美，用现代设计手法重构祁阳文化体现，用新的视角诠释祁阳地域文化，打造祁阳酒店+地域文化+历史文化的现代国潮空间。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '祁阳市金盆西路顺祥郡10栋106号铺');
INSERT INTO `room` VALUES (761563168, '美沙海景度假酒店(阳西沙扒月亮湾滨海乐园店)', '本店位于阳西县沙扒镇月亮湾滨海旅游度假区内，酒店多种房型可供选择。酒店整体装饰简约雅致，客房宽敞洁净，通风采光佳，且配有观 海阳台，宾客临窗即可将整个月亮湾的碧海蓝天尽收眼底，享受海风拂面，放松身心，尽享愉悦慢时光。酒店房内配备空调、液晶电视、24小时热水、无线wifi等，拎包即可入住。酒店临近月亮湾海韵广场沙滩浴场，步行就可到沙滩，周边环境幽雅静谧，景致优美宜人。从酒店出发，开车5分钟即可到达沙扒镇中  心，吃喝玩乐，一应俱全。本地民风淳朴，良心经营，海鲜众多，经济实惠。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县椰林路翡翠湾小区5栋1楼大堂（近月亮湾滨海乐园）');
INSERT INTO `room` VALUES (765931404, '永州华天国际酒店(零陵红星国际广场店)', '酒店地处历史文化古城湖南省永州市零陵区中心繁华位置（鑫龙购物广场、红星美凯龙），交通便捷，地理位置优越，紧邻东山景区、萍洲书院景区、零陵古城景区。酒店由湖南华天国际酒店管理有限公司全权委托管理，总营业面积约20000平方米，总层高为27层，坐北朝南，四面通透。酒店设施设备齐全，拥有各类宽敞明亮的客房，客房建筑面积48平方米起，精选智能灯光、客控系统，电动窗帘，冰箱，中央空调，实木家具，定制高端卫浴、床垫，舒适床上用品，独立宽带等设施，温馨舒适、典雅，可为宾客提供全方位的商旅服务，是您旅游度假、商务接待、娱乐休闲、宴请宾客的上佳选择！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '零陵区湘口馆路与阳明大道交叉口西南角');
INSERT INTO `room` VALUES (776171839, '悦畔湾海景度假公寓(阳西月亮湾店)', '公寓位于月亮湾滨海旅游度假区翡翠湾小区3-4栋，移步即达月亮湾海滩，湾似虹，沙如玉，岸边绿林含翠，海面碧波鄰粼K是大自然的天然 浴场。周边有渔船码头、海鲜市场，近距离领略美丽富饶的渔港风、底蕴深厚的渔家文化与疍家文化，美食、休闲、娱乐精彩纷呈。\n公寓整体装饰简约雅致，客房舒适齐整、宽敞通风；房内配置有线电视、独立WIFI、24小时热水、独立卫浴等设施，阳台可以观看美丽的海景。海滨  浴场内提供有沙滩摩托、香蕉船、飞艇、烧烤烟花晚会，非常热闹，使宾客尽享愉悦的入住时光。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇椰林路翡翠湾小区4栋811室');
INSERT INTO `room` VALUES (862419584, '麗枫酒店(广州太古仓沙园地铁站店)', '本店是铂涛集团旗下力推的中端连锁酒店品牌，依托集团庞大的会员系统。本店是薰衣草元素，香氛文化和酒店的结合，倡导“多一点自在”的生活哲学，为消费者提供自在舒适的旅途生活氛围和更为贴心的新型朋友式服务及商旅居住体验。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区革新路126号-1');
INSERT INTO `room` VALUES (865523629, '郡曼·百侣酒店(万达广场店)', '酒店位于开福区万达广场，毗邻繁华的五一步行街商圈。酒店主打高空观景特色酒店，在酒店房间内就可以俯瞰整个长沙城景、橘子洲和湘江风光带。酒店房间内配置自动窗帘，蓝牙音箱等智能设备。酒店员工服务热情，欢迎您的光临。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '开福区湘江中路开福万达广场C区1号写字楼48楼');
INSERT INTO `room` VALUES (929091259, '优享旅途度假公寓(闸坡北洛湾店)', '酒店位于国内十大美丽海岛之一的海陵岛北洛秘境国际旅游度假区内，区内酒店前临辽阔大海，背靠延绵青峰，进入景区即可感到海风微拂 ，空气清新怡然。邻海水质清澈，沙滩细白柔腻，属于度假区私人沙滩。\n高，碧海蓝天，落日余晖相互辉映。四周配套便利，靠近闸坡大海鲜市场（海鲜购买，加工），闸坡码头（坐船出海打渔），原生态浅海马尾岛（浅  滩赶海），一夜埕步行街（海味特产）。\n入住酒店，愉快享受属于你的海岛慢节奏之旅。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区北洛湾大道北洛秘境国际旅游度假区（北洛秘境售楼部旁）');
INSERT INTO `room` VALUES (933710520, '三川岛宿民宿', '本店由设计师独立打造运营的海景民宿，做不仅仅是睡一觉的地方，更多是美学空间。经过一座城，寻觅一间房，消去您满身的疲惫，我们 将以热情的服务，舒适的房间，期待你的到来。我们，在这里，等您来！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸1座');
INSERT INTO `room` VALUES (940042237, '阳西月亮湾蓝海度假公寓', '公寓位于月亮湾景区内，到达海边浴场仅百步之遥！\n公寓拥有各类客房，合适家庭及眷侣游客入住。房内配有独立观海大阳台、空调、液晶电视、24h热水、独立卫浴、无线网络、冰箱、洗衣机等设施， 满足宾客日常生活所需。\n生活无需别处，海景生活在这里。等您来一次轻松愉悦的滨海度假生活。领略阳光、沙滩、海风的乐趣，是旅游度假的理想胜地。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县碧桂园月亮湾度假区月亮湾大道金兰湾小区1栋1楼');
INSERT INTO `room` VALUES (959350392, '豪怡主题海景度假酒店(阳江海陵岛十里银滩店)', '公寓坐落于旅游海岛、亚洲十里银滩中区位置，地理位置优越，岛上风光秀丽。紧邻海边，距广东海上丝绸之路博物馆仅3公里，前往大角湾景区海上乐园，一夜埕特产街，放生台，马尾岛等出游都很方便。酒店是一家结合多种主题装修风格的特色酒店，打造轻奢享受。公寓装修特色豪华，摆设精致，统一按照酒店标准，配有豪华独立淋浴房，开放式厨房，液晶电视，变频空调，电冰箱，24小时热水供应，无线WIFI等设施设备配套齐全，房内配置都是高品质的被褥以及进口棉浴巾面巾、一次性用品。公寓周边景点，楼下餐馆，便利店，百货等一应俱全，是您体验海岛生活的选择，每个房间具有独特的景观视野开阔露台，现代特色主题风格，让您在享受岛上吃喝玩乐的同时，能有更好的住宿体验。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区南海1号大道万豪海陵湾一号5栋407房（近十里银滩、海滨浴场）');
INSERT INTO `room` VALUES (986331955, '阳江海榭丽舍度假酒店(海陵岛十里银滩店)', '本酒店位于阳江海陵岛十里银难万豪海陵湾一号景区内，2021年精装修的度假式酒店公寓，房间宽敞，每个房间都配有超大观景阳台。日出，日落不同房间均有可能在阳台欣赏到。每个房间均配有独立卫生间，wifi，品牌电视、空调。来到海陵岛，入住本店，给您一个难忘的舒适之旅。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区南海1号大道万豪海陵湾1号11栋406');
INSERT INTO `room` VALUES (1032191064, '龙泽酒店(阳江沙扒月亮湾富力湾店)', '本店位于阳西县沙扒镇月亮湾滨海旅游度假区内，总计拥有客房，分为舒适海景双床房、舒适海景大床房、精选优美海景大床房、精选优美 海景大床房和碧海蓝天亲子套房（两房两厅）多种房型可供选择。酒店整体装饰简约雅致，客房宽敞洁净，通风采光佳，且配有观海阳台，宾客临窗即可将整 个月亮湾的碧海蓝天亲子套房，休闲麻将房，高层一线海景套房等，早上可以睡到床上看日出，傍晚可以看日落，享受海风拂面，放松身心，尽享愉悦度假浪 慢时光。酒店房内配备空调、液晶电视、洗衣机，抽油烟机等，还可以自行烹饪，24小时热水、无线wifi等，拎包即可入住。\n酒店临近月亮湾海韵广场沙滩浴场，2分钟步行就可到沙滩，周边环境幽雅静谧，景致优美宜人。从酒店出发，开车5分钟即可到达沙扒镇中心，吃喝  玩乐，一应俱全。本地民风淳朴，良心经营，海鲜众多，经济实惠。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇滨海旅游度假区月亮湾大道阳江富力湾住宅小区A2栋102房');
INSERT INTO `room` VALUES (1032199020, '尚居海景度假公寓(阳西月亮湾店)', '酒店位于阳西县沙扒镇月亮湾国际滨海度假区内，享约8公里原生态海岸线，沙滩面积退潮时宽度可长达约100米，是天然的玩海胜地。本公 寓所在小区距离海岸线仅直线200米，下楼步行5分钟左右即可到达海岸线。月亮湾2.5公里处是阳西县沙扒镇，享有“广东省十大蕞美乡镇”、“广东省旅游名镇 ”、“吃货天堂”等美誉，夜幕降临时，可租用电动车穿越在琳琅满目的美食街，体验不一样的滨海度假感受。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇碧桂园月亮湾C1区5栋2410室');
INSERT INTO `room` VALUES (1064371683, '诗贝酒店 SpeyHotel(广州龙归金铂广场店)', '酒店是汇年轻、有趣、休闲、社交的全新轻奢品牌,英伦格子元素散落于酒店每一个细节,通过独特的设计格调和场景,为入住者带来区别于传统酒店的体验。多功能社交大堂空间、机器人服务员、智能灯光场景、潮流与经典相融合家具、超4k画质投影仪、65吋投屏电视等设备,智能高级、可玩便捷。浓厚的社交氛围贯穿大堂、餐厅、吧台、露天走廊、健身房等丰富的公区场景。客房釆用“零压床”智能床垫,轻奢舒适;现制营养早餐,中西式美食汇集、趣味小食品可以满足你挑剔的味蕾需求。酒店交通位置优越,毗邻龙归地铁站,靠近民自安步行街、金铂广场随时随地享受舌尖上的美食,离皮革五金城和工业园区一步之遥。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '白云区鹤龙三路42号102室');
INSERT INTO `room` VALUES (1064563081, '粤塔X轻奢电竞公寓(番禺万达广场南村万博地铁站店)', '本店是广州一家高端的电竞酒店，高端电竞、品质服务、休闲娱乐为一体的专业电子竞技酒店。另外配：智能家居、投影仪、高端电竞电脑；电脑配置：技嘉CPUi7-9700KF+技嘉2080S+卓威明基27寸240HZ显示器；技嘉2070S+AOC32寸2K144显示器；技嘉2060+AOC32寸1K144HZ显示器。外设配有海盗船机械键盘，罗技502鼠标，西伯利亚耳机等；酒店位于广州番禺南村汉溪大道东万达广场B-4栋36楼，地处番禺核心商圈万博CBD，提供限时停车等方便快捷基础设施。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '番禺区南村镇汉溪大道东368号万达广场B-4座36层（距南村万博地铁站B出口500米）');
INSERT INTO `room` VALUES (1073044724, '华诺度假公寓(敏捷黄金海岸店)', '游玩便捷，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸浪琴湾1栋1楼113房（近海滩）');
INSERT INTO `room` VALUES (1075855100, '凯里亚德酒店(湖南金融中心店)', '酒店坐拥湖南金融中心核心位置，景致秀美的湘江河畔，毗邻地铁4号线（茶子山站3号出入口），地处茶子山路与佑母路交接处启迪协信2栋。与长沙市文化标志打卡点“三馆一厅”隔江相望。长沙市委政府，凯德壹中心，大学城，王府井，美食，各大金融银行近在咫尺。酒店距离岳麓山景区，湖南师大，东方红广场，渔人码头，商学院仅10分钟的车程，到橘子洲游玩只需要12分钟。距长沙站12公里，车程仅需26分钟。距长沙高铁南站25公里，车程仅需40分钟。黄花机场35公里，车程仅需40分钟。还可以在橘子洲看烟花晚会，欣赏梅溪湖音乐喷泉。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '岳麓区潇湘北路启迪协信2栋43楼（近地铁4号线茶子山站2A口）');
INSERT INTO `room` VALUES (1098955747, '松墅国际公馆(广州花都广场店)', '本店品牌调性关键词：新众腔调、当代艺术、回归自然、小众而精、质感格调。\n品牌门店遍布全国。弘扬国风元素住宿文化，酒店由知名设计师亲自设计，灵感源于创始人对生活美学的品味追求，拥有罗汉松设计系列客房，以创新性、个性化的优质服务，注重客户体验，筑梦+实现的服务理念，恰到好处得满足客户对酒店住宿的一切需求。\n酒店位置：位于广州花都中心宝华路78号天美商业城，配套DK公社西餐音乐酒吧、格兰酒吧、loot咖啡厅、中餐厅、西餐厅，网红直播基地等大型商业综合体，毗邻繁华的曙光路美食酒吧街、来又来广场、大润发市场等。 酒店在9号线花都广场站附近，设有健身房，洗衣房，会客大厅，适合商旅人士以及情侣出游，度假旅行人士。\n我们的愿景：带给入住到我们酒店的人群一种返璞归真，回归自然，身心放松而又别具一格的入住体验。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '花都区宝华路78号天美城B座1楼8号');
INSERT INTO `room` VALUES (1171114983, 'CHILL TIME超叹电竞酒店(广州塔店)', '本店致力打造全广东高端型电竞酒店！毗邻广州塔，琶洲会展中心，豪华复式的电竞环境，优质的服务，优越的地段和智能化家居的配套设施，萨博朋克既视感，设施都是按照酒店的标准来配置的，3D立体环绕音大屏幕电视，配有落地大窗，潮流灯光摆件，必将给您耳目一新的感受与体验，竭诚为广大电竞爱好者提供高标准，规范化的优质服务，期待您的莅临！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区新港东路43-1号邦泰公馆1层');
INSERT INTO `room` VALUES (1199052290, '自定义·设计师酒店(五一广场地铁站店)', '酒店--是几个年轻人倾注在此的心血，让您感受家的温暖，酒店简约的轻奢设计，主打loft不同的风格房型。在追求设计感的同时给您家一般的温馨。优选床品和洗漱用品，营造舒适的居住环境。\n《交通便利地铁》距离地铁五一广场站6a出口5分钟即达。\n《交通便利火车站》出地铁站乘坐地铁五一广场站6A出口全程大约20分钟。\n《交通便利高铁站》出高铁乘坐地铁到五一广场站6A号出口步行到店，全程大约30分钟。\n《交通便利机场》可选择机场大巴到民航达酒店转乘地铁，或达乘磁悬浮到长沙南站转乘地铁到五一广场站6A号出口，全程约1个小时。\n《吃喝玩乐》出门步行10分钟左右就是太平街，坡子街，三王街，周边有国金中心IFS，新世界百货，平和堂，春天百货。黄兴步行街，王府井商场，沃尔玛超市，距离橘子洲头，岳麓山风景区坐地铁2号线五一广场站，坐公交222路可直达省博物馆，世界之窗。\n《酒店服务》24小时前台服务，提供行李寄存。\n经过一座城，寻觅一间房，消去您满身的疲惫，舒适的房间，我们将以更热情的服务，期待您的道来！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '芙蓉区定王台街道中山路267号3楼（近五一广场地铁站6A出口）');
INSERT INTO `room` VALUES (1221066502, '海上见蓝天美宿(海陵岛十里银滩店)', '本店坐落于闸坡海陵岛十里银滩（南海一号博物馆东侧），靠近南海一号高尔夫球会。\n这里的公寓装潢精美，设施完善，无线网络覆盖让你随时能刷朋友圈和聊天。\n卧室布置得温馨舒适，床被柔软整洁，还有电视、洗浴间等，让你出门在外也能感受家的温馨。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区闸坡镇海陵岛宋康大道南海湾花园3栋2单元1楼');
INSERT INTO `room` VALUES (1221913271, '海岛优品度假公寓(阳江海陵岛闸坡碧桂园北洛明珠店)', '公寓位于闸坡海陵岛碧桂园北洛明珠，紧挨北洛秘境、天际泳池、北洛沙滩、玻璃栈道、马尾岛等景区，交通便利，出行方便。设有收费停 车场，车位充足。房间可以观日落，听涛，完全WIFI覆盖，设有液晶电视，壁挂空调，24小时热水。本公寓设有单间套房、标准双床房、两室一厅多种户型， 适合公司团建、朋友聚会、家庭出游。欢迎您的光临！', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区试验区闸坡镇北洛大道199号碧桂园北洛明珠花园6栋106房');
INSERT INTO `room` VALUES (1225566283, '漫诗·轻享海景公寓酒店(阳西月亮湾滨海乐园店)', '酒店位于月亮湾滨海旅游度假区，一线海景尽收眼底，酒店独特的设计，带来更自由的舒适空间，自由敞亮，每个房间均配备有全自动洗衣 机、等居家设施，另外，距离酒店100米范围内有月亮湾滨海浴场，网红沙滩打卡点，摩天轮游乐场，美食广场等娱乐休闲项目，期待您的再光临，祝您旅途  愉快。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道滨海旅游度假区碧桂园月亮湾月泉海C1区5栋606');
INSERT INTO `room` VALUES (1262386861, '民惟鑫阁酒店公寓(金沙洲店)', '酒店位于金沙洲万达星港城BGM食番叮，身处商业中心，周边吃喝玩乐于一体，金铂天地，国昌新城市场均为百米以内， 附近一带广式茶餐厅，夜宵大排档，各种中式西式餐厅一应俱全，酒店距离沙堤机场仅21km，距离广州火车站仅12km，交通便捷，距离地铁五号线六号线均在6km，附近百米内均有公交车直达，知名的景点食番叮街道，让您可以体验到美食同时，也可以分享您的快乐，你可以根据时间提前做好行程安排。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区大沥镇黄岐沙溪路星港城F座1907房');
INSERT INTO `room` VALUES (1263631268, '阳江十里银滩海边轰趴度假别墅', '本店位于保利银滩，店内施舍齐备，欢迎您前来体验！经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利银滩P区5-1栋03铺（近儿童水上乐园）');
INSERT INTO `room` VALUES (1265732850, '巴里岛度假别墅公寓(阳西沙扒店)', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道滨海旅游度假区富力湾住宅区B2栋01铺');
INSERT INTO `room` VALUES (1274892846, '艺选酒店(宁远文庙店)', '本店位于湖南宁远市重华北路，地理位置优越，酒店周边吃喝玩乐一应俱全，交通畅通便捷。 酒店始终秉持服务至上的宗旨，24小时全天候前台服务，随时为到店的旅客排忧解难，相信热情细致的服务可以给您的旅途更添精彩。酒店有多种优质房型，可以满足不同客人的需求。房间安静舒适，简洁大方的装饰设计，品牌定制的床品，优质的房间设施，为你营造入住的良好氛围。客房卫生定时更换清洁，为客人打造舒适干净的入住环境。无论是商务出差或是出门游玩，酒店都是您出行的理想下榻。 酒店步行5分钟路程是全国重点文物保护单位、九疑山风景名胜区重要人文景观——宁远文庙。周边还有舜帝陵，九嶷山，舜庙，李郃状元楼，舂陵侯城遗址，泠道故城遗址等景点。 酒店设有多种房型，可满足不同客人的需求，房间设施齐全，干净舒适，是您出行理想的下榻之所。', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '宁远县重华北路109-1号（近九亿街）');
INSERT INTO `room` VALUES (1290545250, '朵兰达V酒店(长沙五一广场IFS国金中心店)', '本店作为酒店集团“V”系列的旗舰店，传承了集团引进的日韩式酒店管家理念，做有温度的服务。分店配置有客房，包括智能大床房、影音大床房、棋牌大床房以及零压双床房、豪华亲子房等多种房型；提供停车场，自助早餐厅，24小时健身房，洗衣房，150平溶洞风格会议室等配套一应俱全；公区超高格调，房间全屋智能，所有房间铺设的都是零压床垫，力求给每位贵宾舒适的睡眠享受。入住还享有百项服务，24小时不限量饮品，精美下午茶，晚安甜品，不限件数洗烘衣服务，行李寄送等一系列礼遇。地处长沙核心商圈，轻松打卡各种目的地。在这里贵宾能真正体会：细细刷牙、慢慢洗澡、好好睡觉、静静生活！欢迎来到我们的世界，我们期待着您！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '开福区芙蓉中路一段515号');
INSERT INTO `room` VALUES (1294696164, '海王星主题假日酒店', '酒店位于广东省阳江市海陵岛保利银滩N2区。酒店地理位置优越，距离海边仅50米，坐落于十里银滩，楼下就是沙滩，酒店的海景和绿化都相当优美。毗邻景点有十里银滩，南海一号国家博物馆，谷寮大宋文化古渔村，天麓山风车山顶公园等等。酒店区域内设有各式标准健康绿化设施，沙滩有HAPPY沙滩音乐烧烤酒吧，网红粉色沙滩拍照露营地，海边有沙滩车、海上快艇、摩托艇、海上拖伞、香蕉船等娱乐设施游玩。经过一座岛，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来！', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区闸坡镇保利大道保利银滩N2区海王星1楼大堂105室（近南海一号博物馆，距十里银滩68米）');
INSERT INTO `room` VALUES (1306134358, '悠闲度假海景酒店(阳江海陵岛闸坡碧桂园北洛明珠店)', '酒店位于闸坡镇大角湾景区内，周边设施齐全，临近马尾岛，大角湾等景区，酒店房间设备齐全，新颖具有独特的装修风格，房内均有视野 广阔的阳台，可观海景，日落等美丽动人的景色。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛大道199号碧桂园北洛明珠3栋1楼（近马尾岛、北洛秘境国际旅游区）');
INSERT INTO `room` VALUES (1309731430, '丽湾公寓酒店(阳江百利广场店)', '酒店坐落于阳江市江城区北环路102号建华悦景台。\n是一家以标准建造的大型综合性商务出行酒店。\n酒店附近交通便利：距城南客运站2.3km、距阳江粤运汽车站2.5km、二运客运站2.8km、距阳东汽车总站5.2km，阳江火车站驾车只需15分钟，酒店自  带大型停车场；\n住店之余还可以到附近的北山公园（100m）、北湖公园（500m）等地方逛逛，感受浓浓的满满的生活气息，这都是晚间休闲散步和吃喝玩乐的上佳之  地。\n酒店拥有独具特色的投影客房、商务大床房、商务双床房、等多种房型供您选择，每间客房均配有采光大阳台，标配洗衣机，让出行的您衣食无忧。\n更重要的是，酒店秉承着干净舒适的理念，坚持一客一换原则，对每间房都定期消杀，开窗通风保持室内空气清新干燥，减少蚊虫的滋生。出门在外  ，就是住的方便，住的舒服，酒店致力打造区域新标杆，为每一位客人提供良好的住宿环境。 \n风里雨里，在陌生的城市里，小店的小伙伴们都会在这里等你；愿您每天都有一份好心情，去迎接明天的快乐旅途，期待与您的下次相遇，祝您旅途  愉快，工作顺利。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区北环路102号');
INSERT INTO `room` VALUES (1327154791, '十米潮假日酒店', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 18, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇海滨东路27号');
INSERT INTO `room` VALUES (1328871241, '如驿酒店(市桥地铁站店)', '本酒店以“小清新，舒适始于您”为核心价值主导，倡导一种旅途中的新生活态度，酒店地理位置佳，坐落于广州番禺市桥繁华商业商圈，畅享购物、美食、娱乐、休闲、办公、商务、旅游七大功能。钻汇珠宝购物广场、地铁三号线步行900米至酒店，易发商业街，酒吧一条街，毗邻长隆欢乐世界，长隆野生动物园，大夫山森林公园等多个旅游景区，是您商务，休闲，度假理想之选。酒店新装修，多间商务客房，房间宽敞明亮，多种房型供您挑选,交通便利，智能机器人随时为您开启管家式服务！酒店的玫瑰花茶随时恭候您的体验！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '番禺区大北路320号（近地铁3号线市桥地铁站D出口，易发步行街）');
INSERT INTO `room` VALUES (1401500154, '海皇星星辰度假酒店', '酒店位置优越，距离海边仅50米，坐落于十里银滩。经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 15, '2022-12-15 18:20:15', '2022-12-15 18:20:15', '江城区保利大道十里银滩n区海王星3楼01室（近沙滩）');
INSERT INTO `room` VALUES (1431244698, '朵兰达LAB酒店(五一广场贺龙体育馆店)', '本店位于劳动西路344号有色大厦10F。邻近地铁1号线和地铁3号线交汇处——侯家塘地铁站，酒店近贺丨龙体育馆，田汉大剧院，省儿童医院，雅礼中学和雅礼长沙第十五中学等。本店集团企业灵魂----有温度的服务，集团引进日韩式酒店管家理念，拥有24H私人管家贴心服务。由设计师精心雕铸。在这里一切的美好，您值得拥有。酒店拥有高清巨幕影音，0压床品，许您婴儿般的睡眠。拥有咖啡奶茶粥类饮品的书咖休闲区，净氧洗衣房（洗衣服务）烘干设备，电脑以及复印，打印影印设备。另外前台提供有针线包、男女士护肤化妆品、婴儿用品、美食攻略、旅游攻略、基础药品等一百多种生活便利品方便贵宾使用。在这里贵宾能真正体会：细细刷牙、慢慢洗澡、好好睡觉、静静生活！欢迎来到我们的世界，我们等待着您！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区劳动西路344号有色大厦2层');
INSERT INTO `room` VALUES (1439566898, 'TOK-BUFF电竞酒店(越秀广州火车站地铁站店)', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '越秀区站前横路22号（近流花展贸中心、越秀公园地铁站）');
INSERT INTO `room` VALUES (1451939564, '宜尚S酒店(广州体育西路地铁站旗舰店)', '宜尚S酒店（广州体育西路地铁站旗舰店）是东呈国际集团旗下的高端品牌，地处天河繁华商圈， 风土人情与现代生活兼而有之，是旅游、商务、休闲的理想选择，周边旅游景点众多，毗邻太古汇、万菱汇、正佳广场、天河城等大型商场，亦可乘坐APM线至海心沙夜游珠江码头，观赏小蛮腰夜景，广州塔，正佳极地海洋世界，广州动物园等，体育中心近在咫尺，交通通达便利，步行约1分钟可达体育西地铁站A口（1号线与3号线）。\n　　酒店旨在为宾客提供高颜值、自在、有格调、接地气的产品服务，在设计中融入潮流、轻质、美感、社区等丰富文化元素，让每一位宾客都可以在这里体验小美生活方式；酒店拥有80间客房，装潢雅致、风格多变，并设有自助餐厅、咖啡吧、洗衣房、图书吧等多功能配套；客房温馨舒适，并配备智能控制、新风系统、高速无线、环保用品等产品设备，满足旅途中小而美之必要生活。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '天河区天河街4号（距体育西路地铁站A口200米）');
INSERT INTO `room` VALUES (1466334205, '极境轻奢电竞酒店(IFS国金中心店)', '本店位于长沙核心地段长沙市五一广场，酒店紧靠地铁五一广场枢纽站，交通十分便利。楼下即为繁华闹市，步行几分钟可到达五一广场、步行街，继而可继续到黄兴广场、坡子街、太平街等长沙网红打卡地。 酒店聘请国内知名设计师倾情设计，装修采用定制家具家居等高端用品。为丰富您的旅途生活，酒店全部采用大屏幕投影代替单一电视，让您在旅途休息之余尽享私人影院感受。作为网红城市的长沙，美食美景不可少。聚众打卡的茶颜悦色、文和友、小龙虾、臭豆腐均近在咫尺，让您的舌尖同样也进行一场美妙的旅途。IFS国金中心、橘子洲、岳麓山、省博物馆等文化美景旅游胜地也均可快速到达。酒店，您外出旅途的安睡臻享之地，欢迎您的到来。', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '芙蓉区五一大道838号新成大厦6楼（郡曼酒店同栋,长沙市口腔医院旁）');
INSERT INTO `room` VALUES (1475755789, '阳江海陵岛十里银滩听涛海景度假酒店(敏捷黄金海岸店)', '公寓位于广东省阳江市敏捷海岸聚龙湾,距离十里银滩80米，近恒大海上夏威夷。公寓没有停车位，景区内有大型地下停车场。\n公寓周边商圈：景区内有一个水晶湖，设有海水，淡水泳池和海滩，以及趣味分呈的水上乐园。15公里内的景点有：南海1号博物馆、红树林湿地公园 、东方银滩（望海亭）、大角湾、风车山等。\n公寓周边交通:景区内交通方便，公车可接驳阳江高铁站和汽车站相关交通枢纽。\n公寓特点：酒店被热带绿萌环绕。公寓装修豪华，客房时尚高雅，不仅崇尚自然风格，又配有豪华公寓式酒店的独立沐浴房，开放式厨房，电冰箱洗  衣机等齐全设备，给您温馨的居家感受。公寓内有空调，24小时热水供应，液晶电视，无线网络（WIFI），床等崭新设备，温馨舒适的家庭式服务，轻奢优美 的建筑风格，以及椰风金沙的银滩海岸，是您住宿旅游的理想选择。 \n公寓周边配套：特色的小吃街，超市，餐馆，当地特色小店一应俱全，你可以抛开繁忙紧张的都市生活，全身心体验生活。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸聚龙湾35幢2楼214房（近十里银滩、恒大海上夏威夷）');
INSERT INTO `room` VALUES (1482870574, '宜希酒店(阳江西平路百利广场店)', '本店位于阳江市江城区西平北路271号，阳江汽车总站直线距离400米左右，距离阳江新达城购物广场500米左右，交通非常方便，是一家主  打高性价比的商旅舒适型综合酒店，房间装修设施齐全，风格简约时尚温馨，酒店有大床房，双床房，婚庆房，麻将房，洗衣房，自助早餐等一系列配套设施 设备，还提供机器人配送服务，酒店大堂配有商务坐席，书吧，各色茶点供住客们使用和体验。（提供停车服务）酒店楼后设大型地面停车场可供旅游大巴和 自驾乘客停放（交通便利）距离阳江高速路口直线距离800米左右，阳江汽车总站400米左右，距离阳江市高铁站直线距离4公里左右，距离新达成广场500米左 右，百利购物广场600米左右，东汇城购物广场900米左右，盈信广场1000米左右，距离大角湾旅游区40公里左右（酒店硬件）自助机器人配送服务，品牌独立 空调，电子产品设备及办公设备等（光纤网络）千兆光纤网络，房间独立WiFi（行政中心）距阳江市江城行政服务中心600米左右（酒店承诺）客房布草一客  一换，提供一次性用品（周边景点）金山植物公园1公里，鸳鸯湖公园2.5公里左右，森林公园3公里左右，海陵岛大角湾旅游区40公里左右，沙扒珍珠湾50公  里左右（吃喝玩乐）君怡广场200米左右，新达成广场500米左右，百利购物广场600米左右，周边各色小吃，饭店，KTV，沐足，电影房等一系列配套设施，酒 店全新装修，酒店全体员工真诚欢迎全世界各地的宾客光临！为您提供舒适，温馨的住宿环境是我们酒店全体员工永远不变的目标。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区西平北路278号（距君怡沃尔玛100米,新达城1500米）');
INSERT INTO `room` VALUES (1501035205, 'ins轰趴度假别墅公寓(阳江海陵岛敏捷黄金海岸店)', '本店坐落于阳江海陵岛,毗邻“大角湾风景区,自由岛旅游度假区、南海1号博物馆、妈祖庙、马尾岛、北洛湾风景区等知名旅游景区。8万平  方米水上娱乐城水晶湖亦距离别墅不远,您可以在泳池尽情畅游,也可以去体验丰富的水上游乐项目,共赴一场狂欢之约。\n入住别墅您可以自在憩于海景别墅,或是躺进趣墅打造的主题别墅,感受大海的呼吸。别墅内有多间客房,结合自然风景和现代家居,充分的利用每个空  间,满足都市人的生活趣味。每个房间均使用高端的床上用品,保证您的睡眠质量;设施齐全的家庭厨房,可助您一展厨艺。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海陵镇敏捷大道敏捷黄金海岸海心湾别墅区');
INSERT INTO `room` VALUES (1505913584, '菲里顿主题公寓(阳西月亮湾店)', '本店隶属菲里顿公寓集团。公寓位于沙扒海滨旅游区较好观景地段，座落于美丽的沙扒月亮湾海边上，拥有观海阳台，听着海浪扑打的声音 和迎面吹来的海风，感觉心旷神怡。公寓采用大海风情设计，设有各类豪华客房及套房，配备冷暖变频空调、24h热水供应、液晶电视、无线网络（WIFI），  床等，各消费层次的舒适客房能满足不同宾客的入住需求，优越的地理位置和配套是您夏天理想的度假选址。', 1, 17, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '阳西县沙扒镇月亮湾大道碧桂园山泉海小区7栋1楼大堂');
INSERT INTO `room` VALUES (1530256538, '观海别墅海景房度假公寓', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区敏捷大道敏捷黄金海岸41栋8楼806号');
INSERT INTO `room` VALUES (1531412463, '悦海度假别墅酒店(十里银滩店)', '本店坐落在保利银滩，在阳江占尽地理之宜，本店位于十里银滩的精华路段，位置非常好的，本店可以唱k，打麻将，可以煮饭，提供停车  。对于入住酒店的旅客来说，闲暇时间去附近的十里银滩和闸坡大角湾游玩是一个不错的选择。旅客可以在闲暇时间去酒店的休闲区，提升健康幸福感。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区保利大道1期忘情谷42栋1楼');
INSERT INTO `room` VALUES (1556210550, '依曼酒店(佛山西站沙堤机场店)', '酒店地处广佛经济圈核心地带的南海区狮山镇，是佛山国家高新技术产业开发区的核心园区，毗邻佛山沙堤机场、高铁佛山西站。其处繁华地段，购物方便，交通便捷，距离佛山机场2.5公里、佛山西站2公里、南海汽车客运站1.7公里罗村购物广场1.5公里，是商务及休闲旅游人士的优选下榻之所。\n酒店精心打造舒心安闲的各类主题、豪华、商务客房与棋牌休闲室，客房雅致温馨，配备设施齐全。同时酒店为客户打造一个立体、高品质的健康睡眠系统，采用了符合人体设计的乳胶记忆床垫和拥有专利的“舒适记忆枕”，让您舒适舒心入眠。\n酒店的自助早餐厅设备先进齐全，可为客人提供丰盛且美味的自助早餐，让客人享受家一般的温馨。酒店将以细致周到的服务，为每一位宾客带来不一样的愉悦体验！\n酒店以“休闲温馨”作为酒店的主题，与“现代商务”融为一体，以高雅温馨又不失简约内敛的设计风格，向“社会”出发。“心依为家，德曼为荣”，让任何一位五湖四海的宾客来到酒店都能感受到心有所依的感觉！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区北湖二路雅致商业广场11号（近佛山西站、沙提机场）');
INSERT INTO `room` VALUES (1584066851, '爱维斯海度假公寓(海陵岛北洛湾店)', '经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇北洛湾大道北洛秘境3幢28层2819房');
INSERT INTO `room` VALUES (1595997379, '港湾壹号度假公寓', '别墅位于江城区海陵岛间坡镇保利银滩B、C、E区别墅群，距离南海1号古船约500米，周边景色秀美宜人。\n这里客房宽敞舒适，别墅配有:KTV、冰箱、电视、厨房、厨具、wifi、停车位、24小时热水、24小时管家服务、独立卫浴等设施齐全，让你像住在家里一样自在。\n周边美食、休闲、娱乐精彩纷呈，宾客出行便捷。入住于此，您可以放慢生活节奏，享受您的每一段自在旅程。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区闸坡镇保利大道保利银滩C区珊瑚湾25栋1楼');
INSERT INTO `room` VALUES (1609702805, '佛山璞玉酒店(南海平洲玉器街店)', '酒店位于汇翠广场C座13-16楼，视野开阔，楼下就是玉器街，方便看货，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区柏丽翡翠大道7-10号信汇广场c座4楼（近平洲玉器街）');
INSERT INTO `room` VALUES (1626230873, '海旅行海景度假公寓(阳江海陵岛恒大夏威夷店)', '本店价格亲民，住的舒适，祝您旅途愉快，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到 来。我们，在这里，等您来。', 1, 13, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区594县道恒大御景湾40栋101室（近婚纱摄影基地、南湾银滩）');
INSERT INTO `room` VALUES (1632131704, '希尔曼酒店公寓(阳江海陵岛水上乐园店)', '酒店位于广东省阳江市海陵岛，是海滨岛度假型酒店。距离阳江市区50公里，经广湛高速或西部沿海高速至广州及珠三各地仅需2-3小时，  未来随着“海陵大桥”和高速铁路“深茂段”的开通，海陵岛将纳入珠三地区一小时生活圈，前揽蔚蓝海湾大角湾，后倚天然绿肺大角山，背山面海，占据优良的 海景至高点，视野辽阔。酒店距放生台、钓鱼台仅约200米路程，海上丝绸之路博物馆“南海一号”的必经之路，只需约5分钟车程；与景区海陵岛大角湾水上乐 园浴场仅约500米路程。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区海滨西路1号山海湾度假村A4栋01号商铺');
INSERT INTO `room` VALUES (1634149806, '春语花间海边民宿(海陵岛店)', '', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇保利北洛秘境');
INSERT INTO `room` VALUES (1634176600, '阳江海边度假别墅(海陵岛保利十里银滩店)', '本店里有KTV自动麻将机。诚信经营，窗明几净，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 15, '2022-12-15 18:23:27', '2022-12-15 18:23:27', '江城区保利大道保利银滩别墅B区B2-01');
INSERT INTO `room` VALUES (1646194511, '朋来澳斯特公寓(阳江高铁站金融中心店)', '阳江国际金融中心涵盖情景式体验街区、写字楼。该项目是一个集高端精品商务、商业综合体、餐饮、休闲娱乐、购物等多种业态为一体的 生活休闲胜地。阳江国际金融中心有阳江270度视角空中餐厅。公寓依托于阳江国际金融中心这个大靠山，尽享金融中心设施设备完善及便利之处。公寓外墙  是全幕墙low-e中空玻璃采光，既可降低照明能耗，又显得外墙高端大气。公寓客房室内采用的是智能新风系统，可根据室内条件自动调节送风量，同时安装  的空气净化过滤装饰可确保新风清新品质。公寓4.9米奢华层高，可演绎百变空间。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区东门南路666号阳江金融中心2幢1楼（近阳江高铁站、新都汇时代广场）');
INSERT INTO `room` VALUES (1664652553, '石榴酒店(广州琶洲国际会展中心店)', '本店坐落于广州市海珠区石榴岗路，紧临地铁8号线，乘坐地铁可到广州塔、海心沙公园，三站可达琶洲国际会展中心。酒店周边建有解放军421医院、南方医科大学中西医结合医院、广东省第二人民医院、广州大学城、广东财经大学、广东药学院、长隆主题乐园、丽影广场、国际金融中心等商业区域；更可便捷前往珠江新城、正佳广场、天河城、太古汇等知名商圈。\n酒店由业内资深设计团队设计，大堂融艺术与舒适一体，房内布置温馨、舒适，均配设中央空调、24小时热水、洗漱用品等。同时配有传统精粹的粤菜中餐厅、可容纳120人的会议厅、标准规格的室内恒温泳池及健身房。酒店实现24小时无线上网的个性化服务，是您商务、休闲和举行各种会议宴会的理想选择。\n大型展会及广交会期间酒店更提供班车接驳琶洲国际会展中心（详情请咨询商家），同时还有精美自助早餐以及叫车、叫醒、寄存行李等贴心服务。用心提供全程服务，以期“精致商旅，唯你不凡”。塔;酒店周边有知名的繁华食街，遍布地道的粤菜馆、湘菜馆、海鲜酒家，麦当劳、肯德基等各式小吃；娱乐也十分便利：哈逸电影城、K-party ktv、丽影购物广场及各大银行坐落周边。便利独特的装修，“管家式”服务，使您处处体味本酒店细微、体贴的真情服务。是您到广州参展、会议、出差、旅行的停居之选。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区石榴岗路13-2号');
INSERT INTO `room` VALUES (1668899304, '瑭果精品酒店(佛山西站店)', '本店位桂丹路芦塘段，紧靠佛山西站，毗邻富弘，大润发商业中心，叶问纪念馆，西樵山，孝德湖，有近百家不同风格的餐饮名店，周边娱乐，商场等配套一应俱全。', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '南海区桂丹路芦塘段13号芦塘工业区综合楼1楼大堂（距离佛山西站1.5公里、佛山沙堤机场3公里）');
INSERT INTO `room` VALUES (1687273826, '维也纳国际酒店·广州萝岗科学城店', '酒店位于广州市黄埔区萝岗，发源路与瑞发路交叉口，距公交车站仅1分钟。毗邻宝马培训中心步行仅需5分钟（500米），酒店距香雪地铁站5分钟，G4京港澳高速入口1.8公里，距离万达广场13 分钟，购物广场2公里不到。距离香雪梅花园5公司、创新公园2公里。酒店拥有豪华客房、无柱多功能会议厅可容纳300人，附设自助早餐厅、自助洗衣房、健身房、提供大型停车场。酒店以“经典艺术、健康美食、语音智能化”为产品设计理念，精选实用的配套，结合欧式典雅建筑风格设计，致力于为宾客提供集“超值、美食、深眠、艺术、健康、环保”为一体的商旅享受。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '黄埔区发源路弘大商贸创意园内');
INSERT INTO `room` VALUES (1694171709, '宜尚酒店(广州花都广场地铁站店)', '本店位于广州花都区核地段迎宾大道与曙光大道交汇处，交通便利，距地铁9号线花都广场站B出口仅200米，距离融创文旅城2公里，高铁广州北站3.5公里。周边商业景点丰富，配套设施齐全，距离广州白云机场15分钟车程，马鞍山公园约1公里，500米范围内有骏壹万邦、大润发、来又来、广百百货等大型购物中心，酒店周边商场餐饮酒吧一应俱全，吃喝玩乐便捷。酒店所有房间使用全景落地窗、视野非常开阔，50寸液晶电视，另有影音及棋牌等休闲大房提供。停车位充足，自助洗衣处舒适，酒店WIFI覆盖、24小时热水速热、机器人服务等各类设施，是您商务出行、旅游休闲的品质选择。\n酒店作为东呈酒店集团旗下轻尚北欧风中端酒店连锁品牌，为您提供一个舒适与温暖的住宿环境，是您可靠的选择——“家外之家，可靠之选”。诚挚期待您的光临！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '花都区曙光路69号');
INSERT INTO `room` VALUES (1710809853, 'IU酒店(广州中山大学珠江泳场店)', '酒店位于滨江沿线（珠江泳场旁），门口就是餐饮名店金满城酒楼，珠江夜游中大码头近在咫尺，让您享受珠江美景的同时还能尝尽广州的传统美食，同时酒店有部分一线江景房间，可让您拥江而居，饱览美景。酒店地处滨江路商圈，出行交通便利，毗邻地铁8号线鹭江站A和中大站，交通便利，门口有多路公交巴士搭乘，方便到达广州火车站，广州南站，白云机场。四周分别环绕琶洲国际会展中心、琶醍啤酒文化创意园、小蛮腰广州塔、中大北门广场、中山大学南校区、中大布匹市场、仲恺学院、海印桥、北京路步行街、上下九步行街、江南西商业中心、天河城、星海音乐厅、二沙岛、海心桥、广东省人民医院、中山大学附属医院，坐拥核心地段。周边集医、商、食、文、游、玩于一身，是您出门的理想选择。酒店邻近中山大学、有广州塔（小蛮腰）、海心沙、珠江夜游中大码头，大沙头码头、大元帅府等广州热门景点。\n酒店贯彻年轻新元素，背负着“玩即正义”的使命，全体员工将真诚热情的为您服务并期待您的光临。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区滨江东路29号（近珠江泳场停车场）');
INSERT INTO `room` VALUES (1718353056, '鼎盈度假别墅酒店(阳江闸坡北洛湾店)', '本店是北洛湾风景区网红打卡地，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们 ，在这里，等您来。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区北洛湾大道保利顺峰北洛秘境3栋A1室');
INSERT INTO `room` VALUES (1721697805, '超顽竞界电竞公寓(江南西店)', '本店致力于打造广州本地专业舒适的高端电竞酒店，门店采用专业的电竞及影音设备，专业贴心的服务，本店装修设计由国内知名电竞酒店设计师设计，舒适的入住环境加上有特色的装潢，致力打造当代年轻潮玩的理想之地！', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '海珠区新港西路1号银华大厦3楼');
INSERT INTO `room` VALUES (1727209989, '广飞影视主题酒店(百利广场店)', '酒店坐落于阳江市江城区石湾南路。是一家以标准建造的大型综合性商务出行酒店。\n　　    酒店附近交通便利：距城南客运站1.5km、距阳江粤运汽车站2.8km、二运客运站3km、距阳东汽车总站3km，阳江火车站驾车只需8分钟，酒店 自带大型停车场，等等等等；住店之余还可以到附近的东岳公园（500m）、北湖公园（2km）、中山公园（1.2km）等地方逛逛，感受浓浓的满满的生活气息， 这都是晚间休闲散步和吃喝玩乐的上佳之地。\n　　    酒店配套设施一应俱全，酒店自带大型沐足城，出差之余还能得到很好的保养放松，我们竭力给每一位旅途奔波的家人提供一个良好舒服的  休闲娱乐环境。酒店拥有具特色的主题客房、商务大床房、双人大床房、商务套房等多种房型供您选择，每间客房都能看到独特的城景，给您带来多种入住体 验和通透豁达的心情，同时酒店还配备有多功能展厅以及多功能会议室，二楼中西餐厅，早餐厅在1楼附楼，无论聚会还是会议培训，我们都有能力满足您的  需求。\n　　更重要的是，酒店秉承着干净舒适的理念，坚持一客一换原则，对每间房都定期清洁，开窗通风保持室内空气清新干燥，减少蚊虫的滋生。出门  在外，就是住的方便，住的舒服，酒店致力打造区域新标杆，为每一位客人提供良好的住宿环境。\n　　        风里雨里，在陌生的城市里，小店的小伙伴们都会在这里等你；为每一位风雨归来的家人递上一杯热茶，褪去一身疲惫。愿您每天都有  一份好心情，去迎接明天的快乐旅途，期待与您的下次相遇，祝您旅途愉快，工作顺利。。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区石湾南路139号');
INSERT INTO `room` VALUES (1737100870, '时光M公寓(广州知识城店)', '欢迎入住本店，让我们为您创造美好的回忆。经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '黄埔区峻翰街1号合景天峻A17-18栋106房');
INSERT INTO `room` VALUES (1759818901, '美的鹭湖森林度假别墅', '本店入住时间：14：00--22：30。别墅位于佛山高明美的鹭湖森林度假区内，这片净土以原生态的天然环境引来成群的白鹭在此居住，别墅以白鹭为依托，让度假村在清新的空气中欣赏湖中央一行白鹭上青天的美景，周边更有安纳西小镇、爱丽丝仙境花海、森林探索、越野车体验基地、鹭湖水世界等等游玩项目，打造全系列度假乐园，附近更是有各式餐厅、农家乐可供选择。\n别墅提供周到的管家服务，配套厨房厨具齐全、设备设施一应俱全，满足客人不同的需求，是商务旅行、家庭度假、公司团建的理想好去处！', 1, 6, '2022-12-15 16:06:31', '2022-12-15 16:06:31', '高明区杨和镇美的鹭湖森林度假区鹭湖大道湖山揽墅');
INSERT INTO `room` VALUES (1774402994, '蓝博湾国际酒店', '酒店位于蓝山县中心商业地段——新建路249号，驱车至蓝山汽车站仅5分钟，地理位置优越，交通便利。\n酒店内设大型停车场，客房拥有豪华套房及高级客房等，酒店还配有豪华自助餐厅、洗衣房、宴会厅、会议室、健身房、KTV、书吧、茶吧等各项设施设备。所有客房均由专业酒店设计公司，秉持“精致不粗、高雅不俗、温馨舒适”的设计理念来设计及装修的。下榻酒店，令您的起居倍感愉悦！\n酒店以“宾客至上，以人为本”为经营宗旨，采用了科学的经营机制和管理方法，不断追求，得到了社会的认可，更和有关公司单位达成指定接待酒店，无论商务、宴会、休闲、娱乐，都是您的理想之选。\n酒店，诚心恭候您的光临！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '蓝山县新建路与边贸路交汇处东北角');
INSERT INTO `room` VALUES (1779158285, '魔鬼猫电竞公寓', '魔鬼猫IP赋能高端电竞公寓', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '天河区珠江新城花城大道665号翡丽商务大厦1楼');
INSERT INTO `room` VALUES (1790717330, '阳江迎尚海景度假公寓(海陵岛闸坡北洛湾店)', '本店处于海陵岛十里银滩其中一段的北洛湾风景区内，客房以年轻化的轻奢风格为主，也配备了欧式风格、地中海风格、东南亚风格、南亚 风格等；并有园景、90度观海景、120度观海景、180度观海景，满足各各人群所需！在网红打卡胜地来一场浪漫的旅行吧。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区北洛湾大道保利顺峰北洛秘境3栋1915');
INSERT INTO `room` VALUES (1828234463, '御江·上品酒店(广州北京路地铁站天字码头店)', '酒店位于越秀区沿江中路银海大厦一楼，经过一座城，寻觅一间房，消去您满身的疲劳，我们将以热情的服务，舒适的房间，期待您的到来。我们，在这里，等您来。', 1, 5, '2022-12-15 16:04:42', '2022-12-15 16:04:42', '越秀区沿江中路299号4楼');
INSERT INTO `room` VALUES (1843545690, '曼陀伦智能酒店(阳江新达城店)', '1、酒店位于阳江市江城区（新达城时代广场）A栋二层，当地城北繁华商圈中心。\n\n2、酒店享衣食住行，吃喝玩乐，应有尽有。（Seven Club、摩登演艺餐吧、星光派对KTV、华夏巨幕影城、711便利店、肯德基KFC、赵记甜品、奇遇  西餐、探鱼、椒王火锅、大正寿司、米芝莲、正哥点心皇、周边网红探店打卡美食小店等等）\n\n3、酒店周边毗邻北湖公园、漠阳楼博物馆、石觉寺、天主教露德圣母堂、海陵岛海上乐园和北洛湾景区。\n\n4、酒店周边交通便利，周边公交车众多，随时滴滴叫车；距离阳江粤运站1.3km，车程约7分钟。距离阳江站（高铁）8.4km，车程约20分钟。距离阳  江合山机场18km，车程约30分钟。\n\n5、酒店是广东喜顺酒店管理有限公司旗下以新奇体验精心打造，希望把时尚轻奢和智能便捷带入酒店，带入我们的生活当中，给您带来颠覆传统型酒 店的视觉及体验。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区新江北路福盈新达城时代广场A栋2楼大堂');
INSERT INTO `room` VALUES (1878532963, '轻住·悦享酒店(阳江西平路百利广场店)', '本店隶属于轻住旗下的舒适型酒店品牌，以“ 自在，舒适，怡然”为品牌风格调性。通过独特的设计格调，打造高品质、新生活理念，为追  求品质的你提供舒适的休息空间和自然舒适的居住氛围，让人不自觉的感受自然和舒适，享受不一样的“轻松”文化。酒店设各种豪华客房，设有独立大堂，客 人休息区，独立前台，茶水，停车场。\n\n【酒店位置】：本店位于阳江市主城区江城区西平路77号，酒店别具一格，客房雅致、温馨。\n\n【酒店设施】：酒店周边有停车位。\n\n【酒店周边商圈】：酒店处于百利广场商圈，距百利广场约500米。\n\n【酒店周边车站】：酒店地处阳江中心西平路，门口即是平湾路公交站，距阳江汽车总站约2.8公里，阳江高铁站7公里。\n\n【酒店周边景点】：距闸坡海滨旅游风景区、阳春等旅游景区仅30分钟车程。\n\n【光纤网络】wifi覆盖、百兆光纤网络。\n\n【服务承诺】客房布草正规布草厂洗涤，布草一客一换，毛巾、浴巾均高温处理。', 1, 19, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区西平路77号');
INSERT INTO `room` VALUES (1920655277, '夏日度假酒店(海陵岛敏捷黄金海岸店)', '本店坐落于四季皆宜的广东省海陵岛旅游度假区东南部，坐拥十里银滩5.5公里的海岸线，毗邻景区“十里银滩”、南海一号博物馆，雪流湾  海岸及红树林景区，背山面海，坐北朝南，地理位置优越。无论是自驾游或家庭亲子出游，选择本店入住是不错的选择。', 1, 14, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区闸坡镇敏捷大道敏捷黄金海岸浪琴湾2幢207');
INSERT INTO `room` VALUES (1967283251, '斯悦海滩度假公寓(闸坡北洛湾店)', '公寓位于广东省阳江市海陵岛闸坡镇国际旅游度假区内毗邻大角湾风景区，酒店三面环山，南面临海。珍珠白沙滩，在这里看看人间烟火， 浩瀚星空，落日余晖和海浪。约8公里临海栈道，山体公园，悬崖泳池，网红打卡点近听浪涛拍岸、远赏朝晖晚霞，悠闲愜意。公寓拥有客房和套房，简洁的  现代线条和轻奢设计相得益彰，部分客房含有270度观景阳台，饱览浪漫海岸的美景，配有洗漱用品及舒适床品等设施。无边天际大海相邻，揽270度望海视野 。在星空吧吹着舒适的海风，无论是开怀畅饮还是怡情小酌，都可以暂时忘却时间，尽情享受假期的悠闲时光。无边际泳池是情侣享受浪漫人世界的空间。沙 滩、海岛，享受悠闲时光。270度悬崖泳池，坐南朝北，北倚山恋，迎着柔和的海风，投入到海与天的怀抱。', 1, 16, '2022-12-10 18:30:57', '2022-12-10 18:30:57', '江城区北洛湾大道保利顺峰北洛秘境3栋712室');
INSERT INTO `room` VALUES (1972889959, '美宿欢漫酒店(IFS国金中心五一广场店)', '酒店位于长沙市五一广场中心商业区，楼下就是五一广场地铁站1号出口，毗邻横贯市区的五一大道，周边有黄兴步行商业街，春天百货，国金中心，平和堂，太平街等综合商业区。距离橘子洲景区10分钟车程，距长沙火车站4.8公里只需12分钟车程，距长沙火车南站15.2公里只需29分钟车程，距黄花机场27.6公里只需47分钟，交通便利。客房配备中央空调，卫星电视接收系统，高速国际互联网，新风系统，独立浴室等，设备齐全。酒店以做一个体贴周到的、懂客人生活乐趣的，懂客人所想所需的本地朋友的服务理念，真诚待客，期待您的到来！', 1, 11, '2022-12-15 16:24:41', '2022-12-15 16:24:41', '天心区五一大道655号嘉顿新天地商业裙楼4楼（距五一广场地铁站1号出口20米）');
INSERT INTO `room` VALUES (1990226267, '爱意公寓(愿景国际广场店)', '爱意民宿，房源位于繁华地段愿景国际广场，陆续扩涨中，每间房不同风格，精心布置，浪漫，温馨！', 1, 12, '2022-12-15 16:37:36', '2022-12-15 16:37:36', '冷水滩区梧桐路愿景国际广场A栋');
